(110, '', '', '', '', '', '', '', '', '', '', '<p>Nếu gặp bất kỳ khó khăn gì trong việc đăng ký, đăng nhập, đăng tin hay truy cập sử dụng website nói chung, Qúy vị hãy liên hệ ngay với chúng tôi theo số dt:9033 404 676 hoặc email hotro@tinnhanhonline.vn để được hỗ trợ giúp</p>\r\n', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 1, 0, 0, 0, 1, 0, 'users'),
(1003, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '<h2 style=\"text-align:center\">GIỚI THIỆU MUABAN.NET</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:10pt\">Website&nbsp;<a href=\"http://www.muaban.net/\" style=\"color: rgb(28, 96, 167); box-sizing: border-box; text-decoration: none; text-rendering: optimizeLegibility; cursor: pointer; background-color: transparent;\"><span style=\"color:rgb(255, 0, 0)\">www.muaban.net</span></a>&nbsp;– web rao vặt trực tuyến uy tín tại Việt Nam được quản lý bởi Công ty Cổ phần Mua Bán (MBN). Trang web chính thức hoạt động từ ngày 16/04/2006.&nbsp;Website&nbsp;<a href=\"http://www.muaban.net/\" style=\"color: rgb(28, 96, 167); box-sizing: border-box; text-decoration: none; text-rendering: optimizeLegibility; cursor: pointer; background-color: transparent;\"><span style=\"color:rgb(255, 0, 0)\">muaban.net</span></a>&nbsp;được&nbsp;<strong><span style=\"color:rgb(255, 0, 0)\">độc quyền bảo trợ</span></strong>&nbsp;<strong><span style=\"color:rgb(255, 0, 0)\">thông tin</span></strong>&nbsp;bởi báo&nbsp;<img src=\"http://muaban.net/Uploads/News/Img/logo-muaban.jpg\" style=\"border:0px; box-sizing:border-box; vertical-align:middle\" /></span></p>\r\n\r\n<p><span style=\"font-size:10pt\">Từ tháng 7/2008, MBN được quỹ đầu tư IDG Ventures Việt Nam góp vốn. Với sự đầu tư của IDGVV, MBN có thêm đòn bẩy để phát triển mạnh mẽ các dịch vụ của mình nhằm xây dựng&nbsp;<a href=\"http://www.muaban.net/\" style=\"color: rgb(28, 96, 167); box-sizing: border-box; text-decoration: none; text-rendering: optimizeLegibility; cursor: pointer; background-color: transparent;\"><span style=\"color:rgb(255, 0, 0)\">muaban.net</span></a>&nbsp;thành trang thông tin rao vặt hàng đầu, là kênh thông tin trao đổi uy tín nhất giữa người mua – người bán trên cả nước.</span></p>\r\n\r\n<p><span style=\"font-size:10pt\">Tính đến tháng 3/2015, MBN có hơn 1 triệu thành viên và hơn một nửa số đó thường xuyên đăng tin. Mỗi tháng muaban.net có hơn 45 triệu pageviews (số trang được xem) và hơn 6 triệu visits (lượt xem) từ 2,2 triệu unique visitors (người xem duy nhất). Mỗi người xem trang muaban.net dành khoảng 8 phút trong một lượt truy cập. Mỗi ngày chúng tôi cập nhật mới khoảng 40.000 tin rao vặt ở tất cả các lĩnh vực. Vào&nbsp;<a href=\"http://www.muaban.net/\" style=\"color: rgb(28, 96, 167); box-sizing: border-box; text-decoration: none; text-rendering: optimizeLegibility; cursor: pointer; background-color: transparent;\"><span style=\"color:rgb(255, 0, 0)\">muaban.net</span></a>&nbsp;Bạn có thể:</span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:10pt\">Mua bán, trao đổi bất cứ các mặt hàng nào như: bất động sản, ôtô, xe máy, điện tử điện máy, đồ gia dụng, văn phòng, các mặt hàng linh tinh khác, …</span></li>\r\n	<li><span style=\"font-size:10pt\">Tìm kiếm được các thông tin việc làm, chiêu sinh – đào tạo, các cơ hội hợp tác làm ăn, các dịch vụ tư vấn hỗ trợ pháp luật, các dịch vụ sửa chữa cần thiết cho gia đình/công ty bạn như sửa chữa điện nước, đồ điện tử, nội thất xây dựng, vệ sinh….</span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:10pt\">Đến với&nbsp;<a href=\"http://www.muaban.net/\" style=\"color: rgb(28, 96, 167); box-sizing: border-box; text-decoration: none; text-rendering: optimizeLegibility; cursor: pointer; background-color: transparent;\"><span style=\"color:rgb(255, 0, 0)\">muaban.net</span></a>&nbsp;bạn sẽ được&nbsp;<strong>Mua may – Bán đắt</strong>!</span></p>\r\n', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 1, 0, 0, 1, 1, 0, 'about'),
