(657, 0, 0, 0, 0, 'may-moc-thiet-bi-hien-dai20203.png', 'may-moc-thiet-bi-hien-dai20203_75x83.png', 'Máy móc thiết bị hiện đại', 'Modern Technology', '', '', 'may-moc-thiet-bi-hien-dai', 'modern-technology', '', '', 'Máy móc thiết bị hiện đại, đúng kích thước.\r\nThi công lắp đặt hoàn thiện tại công trình, nhanh chóng, chuyên nghiệp, đạt hiệu quả tốt nhất cho ngôi nhà.', 'Installation at work. Fast, professional, best performance for the house.', '', '', '', '', '', '', 'Máy móc thiết bị hiện đại', 'Modern Technology', '', '', 'Máy móc thiết bị hiện đại', 'Modern Technology', '', '', 'máy móc thiết bị hiện đại, ', 'modern technology, ', '', '', 'Máy móc thiết bị hiện đại, đúng kích thước.\r\nThi công lắp đặt hoàn thiện tại công trình, nhanh chóng, chuyên nghiệp, đạt hiệu quả tốt nhất cho ngôi nhà.', 'Installation at work. Fast, professional, best performance for the house.', '', '', 'Máy móc thiết bị hiện đại', 'Modern Technology', '', '', 'Máy móc thiết bị hiện đại', 'Modern Technology', '', '', 'Máy móc thiết bị hiện đại', 'Modern Technology', 'Máy móc thiết bị hiện đại', 'Modern Technology', 'Máy móc thiết bị hiện đại', 'Modern Technology', 'Máy móc thiết bị hiện đại', 'Modern Technology', 151, 73, '', '', 0, 0, 0, '', 1, 3, 1, 1, 1494988125, 1514083054, 0, '', 'taisaochonchungtoi_kt'),
(656, 0, 0, 0, 0, 'vat-lieu-da-dang-chat-luong03311.png', 'vat-lieu-da-dang-chat-luong03311_75x83.png', 'Vật liệu đa dạng, chất lượng', 'Diversity, high quality materials', '', '', 'vat-lieu-da-dang-chat-luong', 'diversity-high-quality-materials', '', '', 'Đa dạng các loại vật liệu từ gỗ công nghiệp, gỗ tự nhiên, đến gạch đá, các loại thảm trải sàn, hay sơn tường hiệu ứng... Chúng tôi luôn tìm mọi giải pháp vật liệu đảm bảo phù hợp công năng sử dụng và hiệu quả trong thẩm mỹ dành cho ngôi nhà của bạn.', 'Variety of materials from industrial wood, natural wood, stone tiles, carpet... We always look for all materials solutions to ensure the use of the use and aesthetic effect for your home.\r\n\r\n', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0, '', '', 0, 0, 0, '', 1, 2, 1, 1, 1494988039, 1514083204, 0, '', 'taisaochonchungtoi_kt'),
(658, 0, 0, 0, 0, 'chua-ghe-ben-ninh-kieu-la-chua-den-can-tho23110.jpg', 'chua-ghe-ben-ninh-kieu-la-chua-den-can-tho23110_75x83.jpg', 'CHƯA GHÉ BẾN NINH KIỀU LÀ CHƯA ĐẾN CẦN THƠ', '', '', '', 'chua-ghe-ben-ninh-kieu-la-chua-den-can-tho', '', '', '', '', '', '', '', '<p>&nbsp;</p>\r\n\r\n<p>Bến Ninh Kiều hấp dẫn du khách bởi nét đẹp hiền hòa của dòng sông Hậu Giang. Từ đây nhìn ra, có thể thấy NHÀ THỦY</p>\r\n\r\n<p>TẠ trên sông. Nhà thủy tạ này chính là con tàu kiêm nhà hàng nổi phục vụ du khách ăn uống ngắm cảnh về đêm.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tuy nhiên, do nhu cầu du lịch ngày càng nhiều, thay vì chen chúc nhau trên bến Ninh Kiều, khách du lịch vẫn có thể lựa</p>\r\n\r\n<p>chọn khách sạn Ninh Kiều, vừa làm nơi nghỉ ngơi, vừa có được vị trí ngắm cảnh view rộng, thoáng đãng mà không mất</p>\r\n\r\n<p>thời gian và công sức.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/wWTzypn.jpg\" style=\"width: 800px; height: 399px;\" /></p>\r\n\r\n<p>(view từ khách sạn Ninh Kiều nhìn ra bến Ninh Kiều)</p>\r\n\r\n<p>Khách sạn Ninh Kiều là khách sạn đạt chuẩn 4 sao, lấy cảm hứng từ phong cách phương Tây kết hợp với nét đẹp ngọt</p>\r\n\r\n<p>ngào của miền Tây sông nước. Ninh Kiều nắm giữ vị trí đắt địa, đặt ngay cạnh bến Ninh Kiều, do Công ty 622 thuộc Bộ</p>\r\n\r\n<p>Quốc phòng phối hợp với Tamnhinsongda.com tư vấn, thiết kế và thi công nội thất.</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/14963385_1806661232907506_6455790934161411658_n(2).jpg\" style=\"width: 800px; height: 478px;\" /></p>\r\n\r\n<p>Với đội ngũ thiết kế chuyên nghiệp, sáng tạo, Tamnhinsongda.com đã mang đến nét đẹp hiện đại nhưng không kém</p>\r\n\r\n<p>phần đậm đà hương vị miền Tây cho toàn bộ không gian khách sạn.</p>\r\n\r\n<p>Cùng trải nghiệm nét đẹp Ninh Kiều qua những hình ảnh bên dưới nhé.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/14876700_1807169772856652_8521078645718085251_o(2).jpg\" style=\"width: 800px; height: 301px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/14883692_1807169829523313_5438063212042688185_o(1).jpg\" style=\"width: 800px; height: 421px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/14940228_1807170022856627_7279399645258956555_o(1).jpg\" style=\"width: 800px; height: 334px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/14940233_1807169802856649_5941470114846673396_o(1).jpg\" style=\"width: 800px; height: 303px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/14890533_1807169769523319_8468222085079848484_o(1).jpg\" style=\"width: 800px; height: 310px;\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/14917280_1807169766189986_7809233972994005495_o(1).jpg\" style=\"width: 800px; height: 277px;\" /></p>\r\n\r\n<p><font color=\"#1d2129\" face=\"helvetica, sans-serif\"><span style=\"font-size: 14px;\">-------------------------------------------</span></font></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#1d2129;\"><span style=\"font-family:helvetica,sans-serif;\"><span style=\"font-size:10.5pt;\">Tư vấn thiết kế - xây dựng</span></span></span></span></p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#1d2129;\"><span style=\"font-family:helvetica,sans-serif;\"><span style=\"font-size:10.5pt;\">Mr.Hiếu 0909 904364</span></span></span></span></p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attach