rif;\"><span style=\"font-size:10.5pt;\">, <a href=\"mailto:architect@tamnhinsongda.com\">architect@tamnhinsongda.com</a></span></span></span></span></p>\r\n\r\n<p style=\"line-height:normal;\">&nbsp;</p>\r\n', '', '', '', 'Du lịch Cần Thơ', '', '', '', 'CHƯA GHÉ BẾN NINH KIỀU LÀ CHƯA ĐẾN CẦN THƠ', '', '', '', 'CHƯA GHÉ BẾN NINH KIỀU LÀ CHƯA ĐẾN CẦN THƠ', '', '', '', 'CHƯA GHÉ BẾN NINH KIỀU LÀ CHƯA ĐẾN CẦN THƠ, du lịch cần thơ, bến ninh kiều, cần thơ, khách sạn 4 sao', '', '', '', 'CHƯA GHÉ BẾN NINH KIỀU LÀ CHƯA ĐẾN CẦN THƠ', '', '', '', 'CHƯA GHÉ BẾN NINH KIỀU LÀ CHƯA ĐẾN CẦN THƠ', '', '', '', 'KHÁCH SẠN NINH KIỀU ', '', 'Khách sạn 4 sao', '', 'Cần Thơ', '', 'Bến Ninh Kiều', '', 100, 0, '', '', 0, 0, 0, '', 1, 6, 1, 1, 1495011792, 1495015495, 78, '', 'news'),
(659, 0, 0, 0, 0, 'lua-chon-vat-lieu-lat-san32013.jpg', 'lua-chon-vat-lieu-lat-san32013_75x83.jpg', 'LỰA CHỌN VẬT LIỆU LÁT SÀN', '', '', '', 'lua-chon-vat-lieu-lat-san', '', '', '', 'Khi quyết định mua hoặc xây dựng một ngôi nhà, mỗi chi tiết nhỏ đều sẽ được các thành viên trong gia đình chú ý. Một trong những yếu tố cần đặc biệt quan tâm, vì có ảnh hưởng trực tiếp đến vẻ đẹp của ngôi nhà, gắn với điều kiện kinh tế, và mang lại những tác dụng tốt hoặc xấu cho sức khỏe, đó chính là sàn nhà. Việc lựa chọn mỗi loại vật liệu lát sàn sẽ có những ưu nhược điểm khác nhau:', '', '', '', '<p>&nbsp;</p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">Khi quyết định mua hoặc xây dựng một ngôi nhà, mỗi chi tiết nhỏ đều sẽ được các thành viên trong gia đình chú ý. Một trong những yếu tố cần đặc biệt quan tâm, vì có ảnh hưởng trực tiếp đến vẻ đẹp của ngôi nhà, gắn với điều kiện kinh tế, và mang lại những tác dụng tốt hoặc xấu cho sức khỏe, đó chính là sàn nhà. Việc lựa chọn mỗi loại vật liệu lát sàn sẽ có những ưu nhược điểm khác nhau:</p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">&nbsp;</p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p style=\"margin: 0px 0px 6px; font-family: inherit;\"><span class=\"_5mfr _47e3\" style=\"line-height: 0; vertical-align: middle; margin: 0px 1px; font-family: inherit;\"><img alt=\"\" aria-hidden=\"1\" class=\"img\" height=\"16\" src=\"https://www.facebook.com/images/emoji.php/v8/f9e/1/16/27a1.png\" style=\"border: 0px; vertical-align: -3px;\" width=\"16\" /><span class=\"_7oe\" style=\"display: inline-block; font-size: 0px; width: 0px; font-family: inherit;\">➡️</span></span>&nbsp;Gạch&nbsp;<span class=\"_5mfr _47e3\" style=\"line-height: 0; vertical-align: middle; margin: 0px 1px; font-family: inherit;\"><img alt=\"\" aria-hidden=\"1\" class=\"img\" height=\"16\" src=\"https://www.facebook.com/images/emoji.php/v8/f1e/1/16/2b05.png\" style=\"border: 0px; vertical-align: -3px;\" width=\"16\" /><span class=\"_7oe\" style=\"display: inline-block; font-size: 0px; width: 0px; font-family: inherit;\">⬅️</span></span></p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\">Lát gạch hầu như hiện diện khắp mọi nơi trong nhà ở Việt Nam. Nhờ những đặc tính nổi bật, mà đến nay, lát gạch vẫn đang là lựa chọn tối ưu cho các hộ gia đình ở Việt Nam. Gạch lát có rất nhiều loại, gạch ceramic, gạch men, gạch granite và đá nhân tạo. Chính nhờ sự đa dạng về mẫu mã, giá cả hợp lý, mát mẻ, chống thấm, phù hợp với khí hậu nhiệt đới ẩm của Việt Nam, thời gian sử dụng lâu dài và tiện lợi khi vệ sinh, ngày nay, lựa chọn lát gạch vẫn là ưu tiên số một.</p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\"><img alt=\"\" src=\"/upload/images/marble-floor-tile.jpg\" style=\"width: 800px; height: 533px;\" /></p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\"><span class=\"_5mfr _47e3\" style=\"line-height: 0; vertical-align: middle; margin: 0px 1px; font-family: inherit;\"><img alt=\"\" aria-hidden=\"1\" class=\"img\" height=\"16\" src=\"https://www.facebook.com/images/emoji.php/v8/f9e/1/16/27a1.png\" style=\"border: 0px; vertical-align: -3px;\" width=\"16\" /><span class=\"_7oe\" style=\"display: inline-block; font-size: 0px; width: 0px; font-family: inherit;\">➡️</span></span>&nbsp;Sàn gỗ&nbsp;<span class=\"_5mfr _47e3\" style=\"line-height: 0; vertical-align: middle; margin: 0px 1px; font-family: inherit;\"><img alt=\"\" aria-hidden=\"1\" class=\"img\" height=\"16\" src=\"https://www.facebook.com/images/emoji.php/v8/f1e/1/16/2b05.png\" style=\"border: 0px; vertical-align: -3px;\" width=\"16\" /><span class=\"_7oe\" style=\"display: inline-block; font-size: 0px; width: 0px; font-family: inherit;\">⬅️</span></span></p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\">Ngày nay, nói đến sàn nhà, rất nhiều người lựa chọn gỗ lát. Sàn gỗ là sự kết hợp hoàn hảo của thiên nhiên và nhân tạo, mang trong mình sự đa dạng của các loại vân và màu sắc. Ngoài vẻ đẹp bề ngoài, sàn gỗ đem đến cho ngôi nhà sự thoáng mát vào mùa hè, cảm giác ấm áp về đông, thậm chí có thể ngủ trên sàn mà không cần giường. Đây cũng là loại vật liệu có độ bền tương đối cao, nếu biết cách lắp đặt và bảo quản.<br />\r\nSàn gỗ có rất nhiều loại: sàn gỗ tự nhiên và sàn gỗ công nghiệp. Tùy theo nhu cầu và điều kiện, gia đình nên lựa&nbsp;chọn và sử dụng các loại sàn gỗ khác nhau.</p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\"><img alt=\"\" src=\"/upload/images/bi-quyet-chon-san-go-theo-muc-dich-su-dung.jpg\" style=\"width: 800px; height: 522px;\" /></p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\"><img alt=\"\" src=\"/upload/images/laminate-xperience_plus-756-dakota-elm%5B1%5D.jpg\" style=\"width: 800px; height: 476px;\" /></p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\"><span class=\"_5mfr _47e3\" style=\"line-height: 0; vertical-align: middle; margin: 0px 1px; font-family: inherit;\"><img alt=\"\" aria-hidden=\"1\" class=\"img\" height=\"16\" src=\"https://www.facebook.com/images/emoji.php/v8/f9e/1/16/27a1.png\" style=\"border: 0px; vertical-align: -3px;\" width=\"16\" /><span class=\"_7oe\" style=\"display: inline-block; font-size: 0px; width: 0px; font-family: inherit;\">➡️</span></span>&nbsp;Thảm&nbsp;<span class=\"_5mfr _47e3\" style=\"line-height: 0; vertical-align: middle; margin: 0px 1px; font-family: inherit;\"><img alt=\"\" aria-hidden=\"1\" class=\"img\" height=\"16\" src=\"https://www.facebook.com/images/emoji.php/v8/f1e/1/16/2b05.png\" style=\"border: 0px; vertical-align: -3px;\" width=\"16\" /><span class=\"_7oe\" style=\"display: inline-block; font-size: 0px; width: 0px; font-family: inherit;\">⬅️</span></span></p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\">Thảm trải sàn hiện nay đang có mặt trên thị trường với vô vàn mẫu mã, kiểu dáng và màu sắc đa dạng. Việc lựa&nbsp;chọn thảm trải sàn sẽ mang đến không gian cảm giác ấm áp, gần gũi. Thảm trải sàn thường được dùng để tăng vẻ sang trọng cho phòng khách, giảm tiếng ồn trong văn phòng, hơn nữa thời gian thi công lại khá nhanh. Hiện nay, có 2 loại thảm cơ bản: thảm dệt tay và thảm dệt máy.&nbsp;<br />\r\nĐối với thảm dệt tay, giá thành cao nhưng rất bền và đẹp. Sau một thời gian sử dụng, nếu không thích có thể bán lại mà giá không chênh lệch với lúc mua nhiều.&nbsp;<br />\r\nThảm dệt máy đa dạng. nhiều mẫu mã, tuy nhiên sẽ không bền và đẹp như thảm dệt tay. Bù lại, thảm dệt máy có giá mềm hơn thảm dệt tay rất nhiều.&nbsp;<br />\r\nMột đặc điểm cần lưu ý khi sử dụng thảm trải sàn chính là vấn đề vệ sinh. Khi bị ẩm ướt, thảm gây ra mùi rất khó chịu. Vệ sinh thảm có thể sử máy hút bụi hoặc nhờ dịch vụ giặt thảm đến để bảo dưỡng, tránh làm hư hại hình dáng và màu sắc thảm.</p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\"><img alt=\"\" src=\"/upload/images/living-room-floor-tile-design-ideas13.jpg\" style=\"width: 800px; height: 534px;\" /></p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: inherit;\">--------<span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\">--------</span></p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#1d2129;\"><span style=\"font-family:helvetica,sans-serif;\"><span style=\"font-size:10.5pt;\">Tư vấn thiết kế - xây dựng</span></span></span></span></p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#1d2129;\"><span style=\"font-family:helvetica,sans-serif;\"><span style=\"font-size:10.5pt;\">Mr.Hiếu 0909 904364</span></span></span></span></p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#1d2129;\"><span style=\"font-family:helvetica,sans-serif;\"><span style=\"font-size:10.5pt;\">Hotline: 08 3829 4405</span></span></span></span></p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#1d2129;\"><span style=\"font-family:helvetica,sans-serif;\"><span style=\"font-size:10.5pt;\">Website :&nbsp;</span></span></span></span><a href=\"http://tamnhinsongda.com/\" target=\"_blank\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#365899;\"><span style=\"font-family:helvetica,sans-serif;\"><span style=\"font-size:10.5pt;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\">tamnhinsongda.com</span></span></span></span></span></a></p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#1d2129;\"><span style=\"font-family:helvetica,sans-serif;\"><span s