 41); font-size: 12px;\">\r\n<div class=\"_51xa _3-8m _3-90\" id=\"photosTruncatingUIButtonGroup\" style=\"margin-bottom: 4px; margin-top: 4px; margin-right: 8px; display: inline-block; vertical-align: middle; white-space: nowrap; font-family: inherit;\"><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"\" src=\"/upload/images/co-ngoc11.jpg\" style=\"width: 400px; height: 269px;\" /></span></span></span></div>\r\n</div>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Bát ngọc đời nhà Thanh (Trung Quốc)</span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"\" src=\"/upload/images/co-ngoc12.jpg\" style=\"width: 400px; height: 305px;\" /></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span aria-live=\"polite\" class=\"fbPhotosPhotoCaption\" data-ft=\"{\" tn=\"\"><span class=\"hasCaption\">Cóc mã não đỏ đời nhà Thanh (Trung Quốc)</span></span></span></span></span></p>\r\n\r\n<div class=\"pts fbPhotoProductsTagList\" id=\"fbPhotoSnowliftProductsTagList\" style=\"padding-top: 5px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 12px;\">&nbsp;</div>\r\n\r\n<div class=\"pts fbPhotoLegacyTagList\" id=\"fbPhotoSnowliftLegacyTagList\" style=\"padding-top: 5px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 12px;\">\r\n<div style=\"font-family: inherit;\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"fbPhotosPhotoButtons\" id=\"fbPhotoSnowliftCallToActionButton\" style=\"cursor: default; display: inline-block; position: relative; user-select: none; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 12px;\">&nbsp;</div