></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"\" src=\"/upload/images/co-ngoc16.jpg\" style=\"width: 400px; height: 300px;\" /></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span aria-live=\"polite\" class=\"fbPhotosPhotoCaption\" data-ft=\"{\" tn=\"\"><span class=\"hasCaption\">Bình đá ngọc lan và cẩu vàng gắn trên sừng tê giác – có tác dụng chống độc khi đựng rượu</span></span></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"\" src=\"/upload/images/co-ngoc17.jpg\" style=\"width: 400px; height: 264px;\" /></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span aria-live=\"polite\" class=\"fbPhotosPhotoCaption\" data-ft=\"{\" tn=\"\"><span class=\"hasCaption\">Vòng ngọc Mắt mèo giát vàng – được coi là linh hồn của bộ cổ ngọc</span></span></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"\" src=\"/upload/images/co-ngoc18.jpg\" style=\"width: 400px; height: 276px;\" /></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span aria-live=\"polite\" class=\"fbPhotosPhotoCaption\" data-ft=\"{\" tn=\"\"><span class=\"hasCaption\">Trâu ngọc trắng đời nhà Minh (Trung Quốc)</span></span></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"\" src=\"/upload/images/co-ngoc19.jpg\" style=\"width: 400px; height: 255px;\" /></span></span></span></p>\r\n\r\n<div><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Ấn triện bằng ngọc</span></span></span></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n', '', '', '', 'ĐỒ CỔ TRUNG HOA', '', '', '', 'ĐỒ CỔ TRUNG HOA', '', '', '', 'đồ cổ trung hoa, ', ', ', '', '', '', '', '', '', 'ĐỒ CỔ TRUNG HOA', '', '', '', 'ĐỒ CỔ TRUNG HOA', '', '', '', 'ĐỒ CỔ TRUNG HOA', '', 'ĐỒ CỔ TRUNG HOA', '', 'ĐỒ CỔ TRUNG HOA', '', 'ĐỒ CỔ TRUNG HOA', '', 0, 0, '', '', 0, 1495073887, 0, '', 1, 5, 1, 1, 1495073881, 1502954047, 158, '', 'bosuutap'),
(780, 0, 0, 0, 0, 'ngoc-an-an-chuong11113.JPG', 'ngoc-an-an-chuong11113_75x83.jpg', 'Ngọc ấn (Ấn Chương) ', '', '', '', 'ngoc-an-an-chuong', '', '', '', 'Những món item vương giả', '', '', '', '<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Ấ</span></span></strong><strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">n chương</span></span></strong><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\"> (con dấu, con triện) là một nét văn hóa rất độc đáo của Trung Quốc. Có thể bằng vàng, đá quý, ngà, xương. Ấn dùng trong công văn giấy tờ đã đành, nhưng ấn có thể kết hợp với&nbsp;</span></span><strong>thư </strong>(thư pháp) và&nbsp;<strong>họa</strong> (tranh thủy mặc).</span></p>\r\n\r\n<p><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#FFFFFF;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14pt;\">Được sử dụng nhằm xác định tính trung thực, tính quyền lực, tính sở hữu và niên đại của n</span></span></span><span style=\"color:white;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14pt;\">hững văn bản quan trọng trong hệ thống chính trị cũng như trong đời sống xã hội nhất định.</span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:white;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14pt;\">Ấn chương tuy chỉ là một vật dụng nhỏ bé, nhưng lại mang tính thực dụng và nghệ thuật hết sức to lớn.</span></span></span></span></p>\r\n\r\n<p style=\"line-height:normal;background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:white;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Đứng về <strong>mặt thực dụng</strong>, ấn chương hay con dấu là bằng chứng trọng yếu trong việc hành sử quyền lực chính trị của một quốc gia hay một chính quyền. </span></span></span></p>\r\n\r\n<p style=\"line-height:normal;background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:white;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">Còn đứng về <strong>phương diện tư nhân</strong> và hoặc giao dịch thương mại, mậu dịch qua lại , ấn chương là một tín vật không thể thiếu được.</span></span></span></p>\r\n\r\n<p style=\"line-height:normal;background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:white;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\">&nbsp;Còn đứng về <strong>phương diện nghệ thuật</strong>, bản thân của ấn chương cũng là một tác phẩm nghệ thuật, được sáng tạo một cách tinh nhã, trạm chỗ chi li tỉ mỉ công phu, với những hoa vằn nhỏ bé, âm dương biến ảo, cùng với&nbsp; nghệ thuật thư hoạ của Trung Quốc, song hành đắp bù cho nhau.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"line-height:normal;background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\">&nbsp;</p>\r\n\r\n<p style=\"line-height:normal;background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:black;\"><span style=\"font-family:times new roman,serif;\"><span style=\"font-size:14.0pt;\"><img alt=\"nội thất cổ điển\" src=\"/upload/images/3%20ng%E1%BB%8Dc%20%E1%BA%A5n.jpg\" style=\"width: 816px; height: 1200px;\" /></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', 'Ngọc ấn (Ấn Chương) ', '', '', '', 'Ngọc ấn (Ấn Chương) ', '', '', '', 'ngọc ấn (ấn chương) , ', ', ', '', '', 'Những món item vương giả', '', '', '', 'Ngọc ấn (Ấn Chương) ', '', '', '', 'Ngọc ấn (Ấn Chương) ', '', '', '', 'Ngọc ấn (Ấn Chương) ', '', 'Ngọc ấn (Ấn Chương) ', '', 'Ngọc ấn (Ấn Chương) ', '', 'Ngọc ấn (Ấn Chương) ', '', 24, 0, '', '', 0, 1502955131, 0, '', 1, 6, 1, 1, 1502955127, 1502955270, 152, '', 'bosuutap'),
(661, 0, 0, 0, 0, '6-phong-cach-thiet-ke-quan-cafe23110.jpg', '6-phong-cach-thiet-ke-quan-cafe23110_75x83.jpg', '6 PHONG CÁCH THIẾT KẾ QUÁN CAFE TUYỆT ĐẸP', '', '', '', '6-phong-cach-thiet-ke-quan-cafe-tuyet-dep', '', '', '', '- Phong cách thiết kế quán Cafe không chỉ thể hiện phong cách của chủ sở hữu, mà còn thể hiện đối tượng khách hàng mà người kinh doanh muốn nhắm đến. Đây là yếu tố cực kỳ quan trọng trong việc thu hút khách hàng và xây dựng thương hiệu. Ngày nay, các quán Cafe thường kết hợp những phong cách thiết kế với nhau hoặc tự trang trí theo sở thích cá nhân. Hôm nay, Tầm Nhìn Sông Đà muốn gợi ý một số phong cách thiết kế quán cafe tuyệt vời cho các bạn muốn mở một quán Cafe đậm chất cá nhân.', '', '', '', '<p>- Phong cách thiết kế quán Cafe không chỉ thể hiện phong cách của chủ sở hữu, mà còn thể hiện đối tượng khách hàng mà người kinh doanh muốn nhắm đến. Đây là yếu tố cực kỳ quan trọng trong việc thu hút khách hàng và&nbsp;xây dựng thương hiệu. Ngày nay, các quán Cafe thường kết hợp những phong cách thiết kế với nhau hoặc tự trang trí theo sở thích cá nhân. Hôm nay, Tầm Nhìn Sông Đà muốn gợi ý một số phong cách thiết kế quán cafe tuyệt vời cho các bạn muốn mở một quán Cafe đậm chất cá nhân.</p>\r\n\r\n<p>1. Phong cách Scandinavian&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/scandinavian-living-room-1.jpg\" style=\"width: 1240px; height: 868px;\" />&nbsp;Đây là phong cách Bắc Âu, được biết đến với 3 đặc điểm nổi bật:&nbsp;</p>\r\n\r\n<p>+ Đơn giản trong thiết kế</p>\r\n\r\n<p>+ Tinh tế trong cảm giác</p>\r\n\r\n<p>+&nbsp;Tiện nghi khi sử dụng</p>\r\n\r\n<p>Scandinavian nổi bật với tông&nbsp;màu trắng tinh thiết, kết hợp với một số vật dụng điểm xuyết, làm tăng vẻ sang trọng và thanh thoát của không gian.</p>\r\n\r\n<p>Hiện nay có rất nhiều quán Cafe ở Việt Nam lựa chọn phong cách này, như Slow&amp;Chill Coffee, Vietcetera Cafe, Thinker and Dreamer Coffee.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. Phong cách&nbsp;Tropical &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/phong-cach-nhiet-doi%20(13)(1).jpg\" style=\"width: 600px; height: 785px;\" /></p>\r\n\r\n<p>Đây được gọi là phong cách nhiệt đới, với màu sắc tươi mát, phù hợp với những đất nước nhiệt đới như Việt Nam. Lấy cảm hứng từ màu xanh cây cỏ và bầu trời, phong cách Tropical sẽ mang đến cho bạn cảm giác sảng khoái cho một ngày cuối tuần hoàn hảo.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/Kien-truc-vn-phong-ngu-thu-gian-theo-phong-cach-nhiet-doi-01.jpg\" style=\"width: 1600px; height: 970px;\" /></p>\r\n\r\n<p>3. Phong cách Vintage Retro</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/16a1e60ef9ab486c6f081df78c3c73f4.jpg\" style=\"width: 620px; height: 415px;\" /></p>\r\n\r\n<p>Không cần phải nói nhiều chắc hẳn các bạn nhận thấy phong cách hoài cổ vintage ngày càng phổ biến và được vô số người yêu thích. Phong cách này hướng đến cảm giác ấm áp, nhẹ nhàng cho con người, sử dụng các gam màu trầm như nâu, vàng, đen, trắng. Một quán cafe vintage sẽ đem bạn trôi trên dòng cảm xúc hoài cổ của bản thân và những chủ ý của chủ quán.</p>\r\n\r\n<p>- Hiện nay ở Sài Gòn có rất nhiều quán cafe nổi tiếng được thiết kế theo phong cách này như Cộng Cafe, Lão Hạc Quán, Coffee Sài Gòn 1975...</p>\r\n\r\n<p>4. Phong cách Contemporary</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/Contemporary-Style-Living-Room.jpg\" style=\"width: 756px; height: 567px;\" /></p>\r\n\r\n<p>Đây là phong cách đương đại, kết hợp giữa phong cách vintage và hiện đại, mang đến cảm giác thoải mái nhưng không kém phần sang trọng cho không gian. Phong cách đương đại là sự kết hợp của những đường nét thẳng và khỏe khoắn, màu sắc trung tính nhưng không quá trầ, sử dụng kết cấu gian nhà và các vật dụng tốt.</p>\r\n\r\n<p>Story M là một quán Cafe mang đậm phong cách contemporary ở Sài Gòn.</p>\r\n\r\n<p>5. Phong cách tân cổ điển</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/thiet-ke-noi-that-tan-co-dien-1.jpg\" style=\"width: 640px; height: 389px;\" /></p>\r\n\r\n<p>Đây là phong cách kiến trúc được tạo ra bởi phong trào tân cổ điển, nhằm chống lại kiến trúc Rococo mang đậm phong cách tự nhiên. Trong công thức kiến trúc, nó như thành quả của sự cổ điển hóa phong cách hiện đại. Tân cổ điển nhấn mạnh vào bức tường chứ không phải mỗi bộ phận của nó. Tô Hiệu Cafe là một trong những quán có cách bài trí nội thất theo phong cách Tân cổ điển này.</p>\r\n\r\n<p>6. Phong cách hiện đại</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/thiet-ke-quan-cafe-dep-factory%20(7).jpg\" style=\"width: 600px; height: 338px;\" /></p>\r\n\r\n<p>Phong cách hiện đại mang nét trẻ trung và tươi sáng, sử dụng các vật dụng đơn giản nhưng sang trọng. Đặc điểm của phong cách này là màu sắc trung tình, kết hợp với hình khối và đường nét của đồ đạc, tạo nên sự khỏe khắn trong từng chi tiết.</p>\r\n\r\n<p>Cheese Coffee là một chuỗi cafe mới mở mang phong cách hiện đại, rất đáng để ghé thăm và thưởng thức.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-----------</p>\r\n\r\n<p>Nếu bạn có nhu cầu muốn thiết kế một quán cafe theo phong cách cá nhân, đừng ngần ngại liên hệ với chúng tôi.</p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#1d2129;\"><span style=\"font-family:helvetica,sans-serif;\"><span style=\"font-size:10.5pt;\">Tư vấn thiết kế - xây dựng</span></span></span></span></p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;\"><span style=\"color:#1d2129;\"><span style=\"font-family:helvetica,sans-serif;\"><span style=\"font-size:10.5pt;\">Mr.Hiếu 0909 904364</span></span></span></span></p>\r\n\r\n<p style=\"line-height:normal;\"><span style=\"background-im