(678, 0, 0, 0, 0, 'su-dung-den-trang-tri-noi-that32323.jpg', 'su-dung-den-trang-tri-noi-that32323_75x83.jpg', 'Sử dụng đèn trang trí nội thất', '', '', '', 'su-dung-den-trang-tri-noi-that', '', '', '', 'Nguyên tắc lắp đèn trang trí cho các căn hộ chung cư nhỏ với trần thấp mà Tầm Nhìn Sông Đà chia sẻ với các bạn sau đây hy vọng các bạn nắm được nguyên tắc và lựa chọn được những sản phẩm đèn vừa độc đáo – lạ mắt về hình thức cũng như phù hợp – tối ưu công năng sử dụng.', '', '', '', '<p><strong>1. Phòng khách</strong></p>\r\n\r\n<p><span style=\"color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">Đèn chính của phòng khách nên là những loại&nbsp;</span><strong style=\"outline: none; color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">đèn trang trí nội thất</strong><span style=\"color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">&nbsp;mang đến sự sang trọng, lịch lãm như đèn chùm trang trí, quạt trần gắn đèn chùm, … Tường có thể dùng đèn trang trí để chiếu sáng phụ cho các phòng có diện tích rộng hay nếu tường nhà bạn dùng gạch thẻ trang trí thì có thể dùng đến đèn góc chiếu hắt vào bức tường để tạo chiều sâu, làm nổi bật các mạch vữa tạo ra nhiều cung bậc mầu sắc khác nhau.</span></p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/shutterstock_75620635.jpg\" style=\"width: 1000px; height: 750px;\" /></p>\r\n\r\n<p><span style=\"color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">Nếu như ở không gian phòng khách</span><strong style=\"outline: none; color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">&nbsp;nguyên tắc lắp đèn trang trí</strong><span style=\"color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">&nbsp;cần tạo nên những góc sáng, góc tối khác nhau thì ở khu phụ lại cần đòi hỏi ánh sáng khuếch tán đều để tạo sự êm dịu thư giãn. Các bạn nên sử dụng bóng quả lê mờ 60 đén 75W. Gương cũng cần dùng đèn chiếu sáng riêng, tốt nhất là mắc đèn ở phía trên treo gương để chiếu sáng vào vị trí mặt người đứng soi. Tủ treo quần áo to với thiết kế kiểu âm tường thì cũng nên có mắc đèn để thuận tiện cho việc sử dụng. Những bóng đèn halogen kích thước nhỏ gắn trên mỗi ô tủ sẽ rất tiện cho người sử dụng. Ngoài ra những ô tủ bầy đồ trang trí được chiếu đèn ngoài tác dụng để chiếu sáng còn làm nổi bật các đồ vật trưng bày.</span></p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/shutterstock_125925200.jpg\" style=\"width: 667px; height: 1000px;\" /></p>\r\n\r\n<p><strong>2. Phòng làm việc</strong></p>\r\n\r\n<p><span style=\"color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">Phòng làm việc nào cũng cần có cường độ ánh sáng ổn định và nên dùng ánh sáng trắng của&nbsp;</span><strong style=\"outline: none; color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">đèn led</strong><span style=\"color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">&nbsp;hay huỳnh quang. Tất cả các đèn phải có chao để người ngồi làm việc với tư thế nhìn ngang không bị lóa mắt bởi ánh sáng trực tiếp từ bóng đèn, đồng thời ánh đèn không được chiếu vào màn hình máy vi tính. Bàn làm việc tối thiểu cũng cần phải có nguồn sáng trực tiếp để không bị thức căng mắt nên dùng&nbsp;</span><strong style=\"outline: none; color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">đèn bàn làm việc</strong><span style=\"color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\">&nbsp;có bóng tròn. Nơi để ngồi viết hay đọc sách báo tốt nhất là các bạn dùng đèn rọi từ trên cao khoảng 40 – 70 cm.</span></p>\r\n\r\n<p><span style=\"color: rgb(1, 1, 1); font-family: open_sansregular, Arial, Helvetica, sans-serif; font-size: 12px; text-align: justify;\"><img alt=\"\" src=\"/upload/images/shutterstock_332078480.jpg\" style=\"width: 1000px; height: 750px;\" /></span></p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/shutterstock_161215766.jpg\" style=\"width: 1000px; height: 727px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/upload/images/shutterstock_318263891.jpg\" style=\"width: 1000px; height: 667px;\" /></p>\r\n', '', '', '', 'Sử dụng đèn trang trí nội thất', '', '', '', 'Sử dụng đèn trang trí nội thất', '', '', '', 'sử dụng đèn trang trí nội thất, ', ', ', '', '', 'Nguyên tắc lắp đèn trang trí cho các căn hộ chung cư nhỏ với trần thấp mà Tầm Nhìn Sông Đà chia sẻ với các bạn sau đây hy vọng các bạn nắm được nguyên tắc và lựa chọn được những sản phẩm đèn vừa độc đáo – lạ mắt về hình thức cũng như phù hợp – tối ưu công năng sử dụng.', '', '', '', 'Sử dụng đèn trang trí nội thất', '', '', '', 'Sử dụng đèn trang trí nội thất', '', '', '', 'Sử dụng đèn trang trí nội thất', '', 'Sử dụng đèn trang trí nội thất', '', 'Sử dụng đèn trang trí nội thất', '', 'Sử dụng đèn trang trí nội thất', '', 269, 0, '', '', 0, 0, 0, '', 1, 8, 1, 1, 1495687701, 1496202566, 117, '', 'news'),
