(680, 0, 0, 0, 0, 'thi-cong-xay-dung30302.jpg', 'thi-cong-xay-dung30302_75x83.jpg', 'Thi công xây dựng', '', '', '', 'thi-cong-xay-dung', '', '', '', 'CAM KẾT CHẤT LƯỢNG:\r\n\r\nTỰ SẮP XẾP VÀ TỔ CHỨC THI CÔNG VÀ GIÁM SÁT THEO QUY TRÌNH CỦA SÔNG TIỀN.\r\nCAM ĐOAN 100% KHÔNG BÁN THẦU – CÔNG TY TRẢ LƯƠNG THỢ HẰNG TUẦN.\r\nCUNG CẤP VẬT TƯ CHÍNH HÃNG THEO HỢP ĐỒNG.\r\nBẢO HÀNH 05 NĂM CHO PHẦN BÊ TÔNG CỐT THÉP, 12 THÁNG CHO PHẦN KỸ THUẬT.\r\nDỊCH VỤ BẢO HÀNH 24/7.\r\n \r\n\r\n', '', '', '', '<p>CAM KẾT CHẤT LƯỢNG:</p>\r\n\r\n<p>TỰ SẮP XẾP VÀ TỔ CHỨC THI CÔNG VÀ GIÁM SÁT THEO QUY TRÌNH CỦA SÔNG TIỀN.<br />\r\nCAM ĐOAN 100% KHÔNG BÁN THẦU – CÔNG TY TRẢ LƯƠNG THỢ HẰNG TUẦN.<br />\r\nCUNG CẤP VẬT TƯ CHÍNH HÃNG THEO HỢP ĐỒNG.<br />\r\nBẢO HÀNH 05 NĂM CHO PHẦN BÊ TÔNG CỐT THÉP, 12 THÁNG CHO PHẦN KỸ THUẬT.<br />\r\nDỊCH VỤ BẢO HÀNH 24/7.</p>\r\n', '', '', '', 'Thi công xây dựng', '', '', '', 'Thi công xây dựng', '', '', '', 'thi công xây dựng, ', ', ', '', '', 'CAM KẾT CHẤT LƯỢNG:\r\n\r\nTỰ SẮP XẾP VÀ TỔ CHỨC THI CÔNG VÀ GIÁM SÁT THEO QUY TRÌNH CỦA SÔNG TIỀN.\r\nCAM ĐOAN 100% KHÔNG BÁN THẦU – CÔNG TY TRẢ LƯƠNG THỢ HẰNG TUẦN.\r\nCUNG CẤP VẬT TƯ CHÍNH HÃNG THEO HỢP ĐỒNG.\r\nBẢO HÀNH 05 NĂM CHO PHẦN BÊ TÔNG CỐT THÉP, 12 THÁNG CHO PHẦN KỸ THUẬT.\r\nDỊCH VỤ BẢO HÀNH 24/7.\r\n \r\n\r\n', '', '', '', 'Thi công xây dựng', '', '', '', 'Thi công xây dựng', '', '', '', 'Thi công xây dựng', '', 'Thi công xây dựng', '', 'Thi công xây dựng', '', 'Thi công xây dựng', '', 297, 0, '', '', 0, 0, 0, '', 0, 2, 1, 1, 1495780690, 1519900047, 60, '', 'tuyendung'),
(681, 0, 0, 0, 0, 'thiet-ke-kien-truc00230.jpg', 'thiet-ke-kien-truc00230_75x83.jpg', 'Thiết kế kiến trúc', '', '', '', 'thiet-ke-kien-truc', '', '', '', 'Thiết kế kiến trúc là sự kết nối hài hòa giữa nội và ngoại thất, giữa con người và không gian sống, giúp sắp xếp các không gian sinh hoạt bên trong phù hợp với nhu cầu và khả năng tài chính của nhà.\r\n\r\nMột kiến trúc đẹp phải hội tủ đủ các yếu tố về thông thoáng, chiếu sáng, cách âm, cách nhiệt, phong thủy, độ bền và tính thẩm mỹ của công trình.\r\n\r\nCông trình được thiết kế đẹp mắt, phù hợp với sở thích, nhu cầu sử dụng sẽ đem đến cho chủ sở hữu một không gian sinh hoạt thoải mái, tốt cho sức khỏe.\r\n\r\nNgoài ra, khi có hồ sơ kiến trúc chi tiết, bạn sẽ dễ dàng kiểm soát được khối lượng công việc, khối lượng vật tư, kinh phí đầu tư và tiến độ thi công.\r\n\r\n', '', '', '', '<p style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; font-family: HelveticaNeue, sans-serif; font-size: 14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: tahoma, geneva, sans-serif;\"><strong style=\"margin: 0px; padding: 0px; box-sizing: border-box;\">Thiết kế kiến trúc</strong>&nbsp;là sự kết nối hài hòa giữa nội và ngoại thất, giữa con người và không gian sống, giúp sắp xếp các không gian sinh hoạt bên trong phù hợp với nhu cầu và khả năng tài chính của nhà.</span></span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; font-family: HelveticaNeue, sans-serif; font-size: 14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: tahoma, geneva, sans-serif;\">Một kiến trúc đẹp phải hội tủ đủ các yếu tố về thông thoáng, chiếu sáng, cách âm, cách nhiệt, phong thủy, độ bền và tính thẩm mỹ của công trình.</span></span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; font-family: HelveticaNeue, sans-serif; font-size: 14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: tahoma, geneva, sans-serif;\">Công trình được thiết kế đẹp mắt, phù hợp với sở thích, nhu cầu sử dụng sẽ đem đến cho chủ sở hữu một không gian sinh hoạt thoải mái, tốt cho sức khỏe.</span></span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; font-family: HelveticaNeue, sans-serif; font-size: 14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: tahoma, geneva, sans-serif;\">Ngoài ra, khi có hồ sơ kiến trúc chi tiết, bạn sẽ dễ dàng kiểm soát được khối lượng công việc, khối lượng vật tư, kinh phí đầu tư và tiến độ thi công.</span></span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, 0, '', '', 0, 0, 0, '', 0, 3, 1, 1, 1495780708, 1519899920, 44, '', 'tuyendung'),
(682, 0, 0, 0, 0, 'quy-trinh-tu-van02310.jpg', 'quy-trinh-tu-van02310_75x83.jpg', 'Cải tạo sửa chữa', '', '', '', 'cai-tao-sua-chua', '', '', '', '', '', '', '', '<p align=\"center\" style=\"margin-bottom:7.5pt;text-align:center;line-height:normal;background:white;\"><font color=\"#000080\" face=\"helvetica neue\"><span style=\"font-size: 24px;\">cải tạo sửa chữa</span></font></p>\r\n\r\n<p align=\"center\" style=\"margin-bottom:7.5pt;text-align:center;line-height:normal;background:white;\">&nbsp;</p>\r\n', '', '', '', 'Quy trình tư vấn', '', '', '', 'Quy trình tư vấn', '', '', '', 'quy trình tư vấn, ', ', ', '', '', '', '', '', '', 'Quy trình tư vấn', '', '', '', 'Quy trình tư vấn', '', '', '', 'Quy trình tư vấn', '', 'Quy trình tư vấn', '', 'Quy trình tư vấn', '', 'Quy trình tư vấn', '', 0, 0, '', '', 0, 0, 0, '', 0, 4, 1, 1, 1495780719, 1519900139, 47, '', 'tuyendung'),
(683, 0, 0, 0, 0, 'can-ho-45m2-su-dung-vach-ngan-bang-kinh-doc-dao10132.jpg', 'can-ho-45m2-su-dung-vach-ngan-bang-kinh-doc-dao10132_75x83.jpg', 'CĂN HỘ 45M2 SỬ DỤNG VÁCH NGĂN BẰNG KÍNH ĐỘC ĐÁO', '', '', '', 'can-ho-45m2-su-dung-vach-ngan-bang-kinh-doc-dao', '', '', '', 'Ở căn hộ này, Tầm Nhìn Sông Đà mang đến một phong cách sáng tạo mới lạ trong việc phân chia không gian nhà chung cư. Bằng kính cường lực, biến tấu với một chút sắc đen mạnh mẽ, không gian 45m2 trở nên sang trọng và rộng rãi hơn rất nhiều.', '', '', '', '<p><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/upload/images/18556760_1697490266932069_8078691965243322640_o.jpg\" style=\"width: 1200px; height: 730px;\" /></span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Phòng ngủ dược đặt bên cạnh cửa sổ lớn, hứng được ánh sáng mặt trời ban ngày, tạo không gian&nbsp;sáng và thông thoáng. Nếu bạn sở hữu căn nhà chung cư từ tầng 8 trở lên, đây sẽ là một cách sắp xếp thú vị cho việc thư giãn ngắm cảnh mỗi ngày. Không gian phòng ngủ được cách điệu với rèm&nbsp;cửa lớn màu be&nbsp;cùng tông màu&nbsp;với phòng.</span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><br />\r\n<span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/upload/images/18588983_1697492413598521_9216120081593246161_o.jpg\" style=\"width: 1200px; height: 729px;\" /><span style=\"font-size: 14px;\">Màu sắc chủ đạo của căn hộ được lấy cảm hứng từ phong cách Scanadivian, với màu sắc nhẹ nhưng sáng, tường các vật dụng đều được chọn màu trắng tinh khôi, điểm xuyết các màu nâu, đen mạnh mẽ.<img alt=\"\" src=\"/upload/images/18527130_1697490356932060_3272468184119399251_o.jpg\" style=\"width: 1000px; height: 1091px;\" /></span></span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Phòng làm việc và bàn ăn cũng sử dụng các chất liệu tương tự, đèn thủy tình trong suốt, kết hợp với bàn ghế góc cạnh.</span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Căn hộ sử dụng các loại đèn tiết kiệm điện ở những vị trí&nbsp;hợp lý, đảm bảo không gian vẫn sáng trưng nhưng tiết kiệm chi phí xây dựng lắp đặt<img alt=\"\" src=\"/upload/images/18527421_1697492406931855_7904663825620824537_o.jpg\" style=\"width: 1000px; height: 1091px;\" /><img alt=\"\" src=\"/upload/images/18556617_1697490383598724_3882174382895517745_o.jpg\" style=\"width: 980px; height: 1200px;\" /></span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Phòng tắm với diện tích nhỏ, nhưng được nhà thiết kế lựa chọn ốp gạch trắng và sử dụng gương lớn, nhằm&nbsp;ăn gian diện tích cho khu vực này.</span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/upload/images/18527147_1697490473598715_2030594507109662175_o.jpg\" style=\"width: 1000px; height: 1200px;\" /></span></p>\r\n', '', '', '', 'CĂN HỘ 45M2 SỬ DỤNG VÁCH NGĂN BẰNG KÍNH ĐỘC ĐÁO', '', '', '', 'CĂN HỘ 45M2 SỬ DỤNG VÁCH NGĂN BẰNG KÍNH ĐỘC ĐÁO', '', '', '', 'căn hộ 45m2 sử dụng vách ngăn bằng kính độc đáo, ', ', ', '', '', 'Công Ty TNHH Tầm Nhìn Sông Đà, chuyên thiết kế thi công biệt thự cổ điển, thiet ke thi cong biet thu co dien, , noi that hoang gia, nội thất đế vương, noi that giac vang, thi cong noi that, thiet ke thi cong quang ninh, xay dung design by nina,', '', '', '', 'CĂN HỘ 45M2 SỬ DỤNG VÁCH NGĂN BẰNG KÍNH ĐỘC ĐÁO', '', '', '', 'CĂN HỘ 45M2 SỬ DỤNG VÁCH NGĂN BẰNG KÍNH ĐỘC ĐÁO', '', '', '', 'CĂN HỘ 45M2 SỬ DỤNG VÁCH NGĂN BẰNG KÍNH ĐỘC ĐÁO', '', 'CĂN HỘ 45M2 SỬ DỤNG VÁCH NGĂN BẰNG KÍNH ĐỘC ĐÁO', '', 'CĂN HỘ 45M2 SỬ DỤNG VÁCH NGĂN BẰNG KÍNH ĐỘC ĐÁO', '', 'CĂN HỘ 45M2 SỬ DỤNG VÁCH NGĂN BẰNG KÍNH ĐỘC ĐÁO', '', 244, 0, '', '', 0, 1495784754, 0, '', 1, 10, 1, 1, 1495784749, 1514080832, 474, '', 'news'),
(684, 0, 0, 0, 0, 'thiet-ke-van-phong-an-tuong02230.jpg', 'thiet-ke-van-phong-an-tuong02230_75x83.jpg', 'THIẾT KẾ VĂN PHÒNG ẤN TƯỢNG', '', '', '', 'thiet-ke-van-phong-an-tuong', '', '', '', 'Các thiết kế hoàn cho không gian văn phòng mới T / H là một doanh nghiệp tái sử dụng thích nghi và sáng tạo một liên doanh giữa TBWA, một công ty quảng cáo toàn cầu, và Hakuhodo, công ty quảng cáo lớn thứ hai của Nhật Bản.', '', '', '', '<p><span helvetica=\"\" neue=\"\" style=\"font-family: \">Các thiết kế hoàn cho không gian văn phòng</span><span helvetica=\"\" neue=\"\" style=\"font-family: \">&nbsp;mới T / H là một doanh nghiệp tái sử dụng thích nghi và sáng tạo một liên doanh giữa TBWA, một công ty quảng cáo toàn cầu, và Hakuhodo, công ty quảng cáo lớn thứ hai của Nhật Bản.</span></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" helvetica=\"\" neue=\"\" src=\"/upload/images/thiet-ke-van-phong-cong-ty-quang-cao-day-mo-mong-tbwa-01.jpg\" style=\"color: rgb(77, 77, 77); font-family: \" /></p>\r\n\r\n<p><span helvetica=\"\" neue=\"\" style=\"font-family: \">Thay vì phủ nhận việc sử dụng ban đầu của không gian, KDa ôm tuyến tính của kiến trúc và thiết kế bố trí văn phòng kết hợp với các con hẻm được xác định trước.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span helvetica=\"\" neue=\"\" style=\"font-family: \"><img alt=\"\" src=\"/upload/images/thiet-ke-van-phong-cong-ty-quang-cao-day-mo-mong-tbwa-02.jpg\" style=\"width: 720px; height: 509px;\" /></span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p><span helvetica=\"\" neue=\"\" style=\"font-family: \">Thay vì phủ nhận việc sử dụng ban đầu của không gian, KDa ôm tuyến tính của kiến trúc và thiết kế bố trí văn phòng kết hợp với các con hẻm được xác định trước.</span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span helvetica=\"\" neue=\"\" style=\"font-family: \"><img alt=\"\" src=\"/upload/images/thiet-ke-van-phong-cong-ty-quang-cao-day-mo-mong-tbwa-03.jpg\" style=\"width: 720px; height: 539px;\" /></span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p><span helvetica=\"\" neue=\"\" style=\"font-family: \">Chiếu sáng và điều hòa không khí đã được tích hợp hoàn toàn với trần nhà và giữa các dầm.</span></p>\r\n\r\n<p><span helvetica=\"\" neue=\"\" style=\"font-family: \">Không gian làm việc cũng đã được sắp xếp giữa các dầm, với lối đi trung tâm màu trắng bắt chước theo khuôn khổ.</span></p>\r\n\r\n<p style=\"text-align: center;\"><span helvetica=\"\" neue=\"\" style=\"font-family: \"><img alt=\"\" src=\"/upload/images/thiet-ke-van-phong-cong-ty-quang-cao-day-mo-mong-tbwa-04.jpg\" style=\"width: 720px; height: 519px;\" /></span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p><span helvetica=\"\" neue=\"\" style=\"font-family: \">Quả thật các tính năng thú vị nhất của không gian văn phòng T / H là thiết kế của phòng dự án hay thay đổi, phòng và văn phòng giám đốc nằm rải rác khắp các không gian họp.</span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span helvetica=\"\" neue=\"\" style=\"font-family: \"><img alt=\"\" src=\"/upload/images/thiet-ke-van-phong-cong-ty-quang-cao-day-mo-mong-tbwa-05.jpg\" style=\"width: 720px; height: 564px;\" /></span></p>\r\n\r\n<p><a helvetica=\"\" href=\"http://noithatart.com/van-phong-lam-viec/\" neue=\"\" style=\"border: 0px; font-size: 13.3333px; margin: 0px; outline: 0px; padding: 0px; text-decoration-line: none; color: rgb(151, 224, 11); font-family: \">Thiết kế văn phòng công ty quảng cáo đầy mơ mộng</a><span helvetica=\"\" neue=\"\" style=\"font-family: \">&nbsp;nổi lên từ sàn gỗ như đồi cỏ nhỏ được bao bọc trong rêu mềm</span></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" helvetica=\"\" neue=\"\" src=\"/upload/images/thiet-ke-van-phong-cong-ty-quang-cao-day-mo-mong-tbwa-06%20(1).jpg\" style=\"color: rgb(77, 77, 77); font-family: \" /></p>\r\n\r\n<p><span helvetica=\"\" neue=\"\" style=\"font-family: \">Các mái ấm cũng có thể truy cập từ đầu, cho phép không gian breakout giản dị và dễ chịu.</span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span helvetica=\"\" neue=\"\" style=\"font-family: \"><img alt=\"\" src=\"/upload/images/thiet-ke-van-phong-cong-ty-quang-cao-day-mo-mong-tbwa-07.jpg\" style=\"width: 720px; height: 620px;\" /></span></p>\r\n\r\n<p style=\"text-align: center;\"><span helvetica=\"\" neue=\"\" style=\"border: 0px; font-size: 10pt; margin: 0px; outline: 0px; padding: 0px; font-family: \">Lối vào chính của văn phòng nằm ở tầng thứ sáu, hoạt động như lễ tân, phòng trưng bày và không g</span><span helvetica=\"\" neue=\"\" style=\"border: 0px; font-size: 10pt; margin: 0px; outline: 0px; padding: 0px; font-family: \">ian hội nghị dành cho du khách.</span></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" helvetica=\"\" neue=\"\" src=\"/upload/images/thiet-ke-van-phong-cong-ty-quang-cao-day-mo-mong-tbwa-08.jpg\" style=\"color: rgb(77, 77, 77); font-family: \" /></p>\r\n\r\n<p style=\"text-align: center;\"><span helvetica=\"\" neue=\"\" style=\"font-family: \">Một cầu thang rộng rơi vào một công viên trung tâm mà chạy xuống trung tâm của tòa nhà.</span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span helvetica=\"\" neue=\"\" style=\"font-family: \"><img alt=\"\" src=\"/upload/images/thiet-ke-van-phong-cong-ty-quang-cao-day-mo-mong-tbwa-09.jpg\" style=\"width: 720px; height: 526px;\" /></span></p>\r\n\r\n<p style=\"text-align: center;\"><span helvetica=\"\" neue=\"\" style=\"font-family: \">khu vực rộng lớn này cung cấp chỗ ngồi bước và một màn hình plasma lớn cho các bài thuyết trình.</span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span helvetica=\"\" neue=\"\" style=\"font-family: \"><img alt=\"\" src=\"/upload/images/thiet-ke-van-phong-cong-ty-quang-cao-day-mo-mong-tbwa-10.jpg\" style=\"width: 720px; height: 524px;\" /></span></p>\r\n\r\n<p helvetica=\"\" neue=\"\" style=\"border: 0px; margin: 0px 0px 9px; outline: 0px; padding: 0px; color: rgb(77, 77, 77); text-align: center;\"><span style=\"border: 0px; font-size: 10pt; margin: 0px; outline: 0px; padding: 0px;\">Các không gian chính nó là khá linh hoạt vì nó cũng được sử dụng cho các sự kiện hợp tác với khách hàng của họ như tiệc, biểu diễn thời trang, sản phẩm.</span></p>\r\n\r\n<p helvetica=\"\" neue=\"\" style=\"border: 0px; margin: 0px 0px 9px; outline: 0px; padding: 0px; color: rgb(77, 77, 77); text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n', '', '', '', 'THIẾT KẾ VĂN PHÒNG ẤN TƯỢNG', '', '', '', 'THIẾT KẾ VĂN PHÒNG ẤN TƯỢNG', '', '', '', 'thiết kế văn phòng ấn tượng, ', ', ', '', '', 'Các thiết kế hoàn cho không gian văn phòng mới T / H là một doanh nghiệp tái sử dụng thích nghi và sáng tạo một liên doanh giữa TBWA, một công ty quảng cáo toàn cầu, và Hakuhodo, công ty quảng cáo lớn thứ hai của Nhật Bản.', '', '', '', 'THIẾT KẾ VĂN PHÒNG ẤN TƯỢNG', '', '', '', 'THIẾT KẾ VĂN PHÒNG ẤN TƯỢNG', '', '', '', 'THIẾT KẾ VĂN PHÒNG ẤN TƯỢNG', '', 'THIẾT KẾ VĂN PHÒNG ẤN TƯỢNG', '', 'THIẾT KẾ VĂN PHÒNG ẤN TƯỢNG', '', 'THIẾT KẾ VĂN PHÒNG ẤN TƯỢNG', '', 222, 0, '', '', 0, 1525085908, 0, '', 1, 11, 1, 1, 1495785932, 1514080796, 96, '', 'news'),
