(775, 0, 0, 0, 0, 'chu-tam-duoc-chung-toi-dat-o-dau12130.jpg', 'chu-tam-duoc-chung-toi-dat-o-dau12130_75x83.jpg', 'Chữ \"tâm\" được chúng tôi đặt tại đâu?', '', '', '', 'chu-tam-duoc-chung-toi-dat-tai-dau', '', '', '', 'Tâm trong từng thiết kế\r\n\r\nTâm trong từng công trình\r\n\r\nTâm trong từng sản phẩm\r\n\r\n', '', '', '', '<p style=\"text-align: center;\">Chữ \"tâm\" được đặt lên hàng đầu trong mỗi thiết kế, sản phẩm và trong mỗ con người Tầm nhìn Sông Đà, từ đó hướng đến vẻ đẹp Chân Thiện Mỹ:</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Tâm</strong> trong từng thiết kế</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Tâm</strong> trong từng công trình</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Tâm</strong> trong từng sản phẩm</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">Vì sao chúng tôi có được một tâm thế vững chải và cứng cáp như vậy?</p>\r\n\r\n<p style=\"text-align: center;\">Bởi vì <strong>Tầm nhìn!</strong></p>\r\n\r\n<p style=\"text-align: center;\">Với phương châm cống hiến để được công nhận, luôn cố gắng vươn lên hoàn thiện nội lực. Để trở thành đơn vị tư vấn, thiết kế, thi công - xây dựng nội ngoại thất số một Việt Nam.</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">Hình ảnh làm nên sản phẩm nội thất ưu việt của Tầm nhìn sông Đà</p>\r\n\r\n<p style=\"text-align: center;\"><u><strong><a href=\"https://www.facebook.com/pg/xuongdogosongda/photos/?tab=album&amp;album_id=1687267618241760\">Hảnh trình sáng tạo</a>:</strong></u></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"Xưởng gỗ nội thất\" src=\"/upload/images/%C4%91%E1%BB%83%20c%C3%B3%20%C4%91%C6%B0%E1%BB%A3c%20s%E1%BA%A3n%20ph%E1%BA%A9m.jpg\" style=\"width: 1200px; height: 1200px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"Hành trình sáng tạo\" src=\"/upload/images/z725203065487_09b0508a2d29d2348222b9f60d55ee29.jpg\" style=\"width: 720px; height: 960px;\" /></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"Hành trình sáng tạo\" src=\"/upload/images/IMG20170413100232.jpg\" style=\"width: 1600px; height: 1200px;\" /><img alt=\"Hành trình sáng tạo\" src=\"/upload/images/z635973544303_9acf5cb93959bc4c88b057dc0f6a3d11.jpg\" style=\"width: 528px; height: 960px;\" /></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"Hành trình sáng tạo\" src=\"/upload/images/IMG_0616.JPG\" style=\"width: 959px; height: 719px;\" /></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"Hành trình sáng tạo\" src=\"/upload/images/x%C6%B0%E1%BB%9Fng.jpg\" style=\"width: 960px; height: 540px;\" /></p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px; text-align: center;\">&nbsp;Xưởng sản xuất và Showroom: B7 - R7 Ấp 2, xã Vĩnh Lộc B, H. Bình Chánh, Tp.HCM</p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px; text-align: center;\">Liên hệ đặt hàng, tham quan <a href=\"https://www.facebook.com/xuongdogosongda/\">Showroom</a> và<a href=\"https://www.facebook.com/xuongdogosongda/\"> Xưởng sản xuất</a>:</p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px; text-align: center;\">CEO <strong>Trương Ngọc Hiếu&nbsp;</strong><br />\r\n<span class=\"_5mfr _47e3\" style=\"line-height: 0; vertical-align: middle; margin: 0px 1px; font-family: inherit;\"><span class=\"_7oe\" style=\"display: inline-block; font-size: 0px; width: 0px; font-family: inherit;\">▶</span></span>ĐT: 0909 904 364 hoặc mr.hieutruong@gmail.com</p>\r\n\r\n<p style=\"margin: 6px 0px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px; text-align: center;\">Văn phòng: 32 Trần Cao Vân P6 Q3, Tp HCM&nbsp;<br />\r\n<span class=\"_5mfr _47e3\" style=\"line-height: 0; vertical-align: middle; margin: 0px 1px; font-family: inherit;\"><span class=\"_7oe\" style=\"display: inline-block; font-size: 0px; width: 0px; font-family: inherit;\">▶</span></span>ĐT: (08) 38 29 44 05 hoặc architect@tamnhinsongda.com</p>\r\n', '', '', '', 'Chữ \"tâm\" được chúng tôi đặt tại đâu?', '', '', '', 'Chữ \"tâm\" được chúng tôi đặt tại đâu?', '', '', '', 'chữ \"tâm\" được chúng tôi đặt tại đâu?, ', ', ', '', '', 'Công Ty TNHH Tầm Nhìn Sông Đà, chuyên thiết kế thi công biệt thự cổ điển, thiet ke thi cong biet thu co dien, , noi that hoang gia, nội thất đế vương, noi that giac vang, thi cong noi that, thiet ke thi cong quang ninh, xay dung design by nina,', '', '', '', 'Chữ \"tâm\" được chúng tôi đặt tại đâu?', '', '', '', 'Chữ \"tâm\" được chúng tôi đặt tại đâu?', '', '', '', 'Chữ \"tâm\" được chúng tôi đặt tại đâu?', '', 'Chữ \"tâm\" được chúng tôi đặt tại đâu?', '', 'Chữ \"tâm\" được chúng tôi đặt tại đâu?', '', 'Chữ \"tâm\" được chúng tôi đặt tại đâu?', '', 244, 0, '', '', 0, 0, 0, '', 1, 18, 1, 1, 1501221746, 1514080518, 62, '', 'news'),
