sp;&nbsp;<img alt=\"Thi công Showroom Viet Solution Đà Nẵng\" src=\"/upload/images/vietso%20DN%203(1).\" style=\"width: 720px; height: 960px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', '<blockquote>\r\n<p>&nbsp; &nbsp; <em>Rome was not built in 1 day.</em>&nbsp;</p>\r\n</blockquote>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; <a href=\"http://tamnhinsongda.com/\">Tầm nhìn sông Đà</a> once again thank our strategic partner <a href=\"http://vietsolutions.vn/\">Viet Solutions</a> for using our construction services.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;With the mission of creating value for all customers, Tầm nhìn sông Đà&nbsp;affirms the brand through dedication, creation.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;These images inspire Tầm nhìn sông Đà create motivation reaching out the next architive.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Thi công Showroom Viet Solution Đà Nẵng\" src=\"/upload/images/vietso%20DN(1).\" style=\"width: 720px; height: 960px;\" /></p>\r\n\r\n<p><img alt=\"Thi công Showroom Viet Solution Đà Nẵng\" src=\"/upload/images/vietso%20DN%202(1).\" style=\"width: 720px; height: 960px;\" /></p>\r\n\r\n<p>&nbsp;&nbsp;<img alt=\"Thi công Showroom Viet Solution Đà Nẵng\" src=\"/upload/images/vietso%20DN%203(1).\" style=\"width: 720px; height: 960px;\" /></p>\r\n', '', '', 'showroom ', '', '', '', 'showroom không gian hẹp', '', '', '', 'showroom nhỏ đẹp', ', _e_0z5n', '', '', 'Cải tạo nhà phố có diện tích 4x17m,gồm 1 tầng trệt và 2 tầng lầu thành Showroom VietSolutions tại Đà Nẵng.Với diện tích nhỏ và hạn chế nhiều mặt, Tầm Nhìn Sông Đà đưa ra phương án tối ưu nhất nhưng vẫn đảm bảo đầy đủ công năng và mỹ thuật cho công trình. ', 'Renovation of the townhouse is 4x17m, including a ground floor and two floors of the Showroom VietSolutions in Danang. \r\n\r\nWith a small area and limited in many aspects, Tầm nhìn sông Đà offers not only the best solution but also giving the showroom full of function. Ensrure texture and art for the project.', '', '', 'Thi công Showroom Việt Solution Đà Nẵng', 'Vietsoluiotns Danang', '', '', 'Vietsolution Đà Nẳng', 'showroom ', '', '', 'tầm nhìn sông đà', 'showroom Danang', 'thi công nội thất', 'best construction services HCM city', 'xưởng thiết kế đổ gỗ HCM', 'wood workshop HCM city', 'xưởng thiết kế đồ gỗ đẹp', 'wood workshop art', 255, 306, '', '', 0, 0, 0, '', 0, 13, 1, 1, 1500520979, 1514080708, 48, '', 'news'),
(768, 0, 0, 0, 0, 'vp-bank-doi-tac-chien-luoc-cua-tam-nhin-song-da12002.png', 'vp-bank-doi-tac-chien-luoc-cua-tam-nhin-song-da12002_75x83.png', 'VP Bank - Đối tác chiến lược của Tầm nhìn sông Đà', '', '', '', 'vp-bank-doi-tac-chien-luoc-cua-tam-nhin-song-da', '', '', '', '\"Muốn đi nhanh hãy đi một mình, nhưng nếu muốn đi xa hãy đi cùng nhau\"\r\n\r\n', '', '', '', '<p>Gặp được nhau là một cái duyên. Giữa&nbsp;biển người mênh, giữa muôn vàn ý tưởng được sản sinh ra mỗi ngày. Chúng ta&nbsp;tìm thấy được người đối tác đáng tin cậty, có cùng lí tưởng, cùng hướng đi đó là một món quà vô giá không gì có thể tả được.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Muốn đi nhanh hãy đi một mình, nhưng nếu muốn đi xa hãy đi cùng nhau</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tài sản phải được kiến tạo để đời sống con người phong phú hơn, trải nghiệm sống nhiều hơn. Vì đến cuối cùng mọi thứ sẽ bị thời gian cuốn đi, điều quý giá còn lại chính là mối quan hệ giữa những con người có cùng chí hướng.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Tâm nhìn sông Đà chân</strong> thành cảm ơn VP Bank Việt Nam đã đồng ý trở thành đối tác chiến lược lâu dài của công ty. Sự thịnh vượng sẽ mang đến đến cho chúng ta những con đường mới hơn nũa.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>VP Bank: Ngân hàng Việt Nam Thịnh Vượng:</strong></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"Đối tác chiến lược của Tầm nhìn sông Đà\" src=\"/upload/images/1.png\" style=\"width: 600px; height: 200px;\" /></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"Đoàn kết chúng ta sẽ kiến tạo được nhiều hơn\" src=\"/upload/images/2.jpg\" style=\"width: 600px; height: 398px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Công ty Tầm nhìn sông Đà:</p>\r\n\r\n<p><img alt=\"Founder Tầm nhìn sông Đà - Trương Ngọc Hiếu\" src=\"/upload/images/website-001(1).jpg\" style=\"width: 800px; height: 1023px;\" /></p>\r\n', '', '', '', 'VP Bank - Đối tác chiến lược của Tầm nhìn sông Đà', '', '', '', 'VP Bank - Đối tác chiến lược của Tầm nhìn sông Đà', '', '', '', 'vp bank - đối tác chiến lược của tầm nhìn sông đà, ', ', ', '', '', 'Công Ty TNHH Tầm Nhìn Sông Đà, chuyên thiết kế thi công biệt thự cổ điển, thiet ke thi cong biet thu co dien, , noi that hoang gia, nội thất đế vương, noi that giac vang, thi cong noi that, thiet ke thi cong quang ninh, xay dung design by nina,\r\n', '', '', '', 'VP Bank - Đối tác chiến lược của Tầm nhìn sông Đà', '', '', '', 'VP Bank - Đối tác chiến lược của Tầm nhìn sông Đà', '', '', '', 'VP Bank - Đối tác chiến lược của Tầm nhìn sông Đà', '', 'VP Bank - Đối tác chiến lược của Tầm nhìn sông Đà', '', 'VP Bank - Đối tác chiến lược của Tầm nhìn sông Đà', '', 'VP Bank - Đối tác chiến lược của Tầm nhìn sông Đà', '', 245, 0, '', '', 0, 0, 0, '', 0, 14, 1, 1, 1500524053, 1514080692, 58, '', 'news'),
(769, 0, 0, 0, 0, 'hop-tac-cung-phat-trien20320.jpg', 'hop-tac-cung-phat-trien20320_75x83.jpg', 'Hợp tác cùng phát triển', '', '', '', 'hop-tac-cung-phat-trien', '', '', '', '\"Nếu muốn đi thật nhanh thì đi một mình. Nếu muốn đi thật xa hãy đi cùng nhau.\" \r\n\r\n- Warren Buffett -', '', '', '', '<p style=\"text-align: center;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Tầm nhìn sông Đà chính thức trở thành&nbsp;đối&nbsp;tác cùng VP Bank kiến tạo nên mọi giá trị&nbsp;công trình.</span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Chúng tôi hân hạnh trở thành đơn vị <a href=\"https://www.facebook.com/tamnhinsongda/\">Tư Vấn - Thiết Kế - Xây dựng</a> cho các dự án đầu tư bất động sản của VP Bank</span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Với kinh nghiệm&nbsp;<a href=\"https://www.facebook.com/tamnhinsongda/\">Tư Vấn - Thiết Kế - Thi công</a> các <a href=\"http://tamnhinsongda.com/noi-that.html\">gói nội thất chung cư</a>, Tầm nhìn sông Đà chuyên:</span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"color: rgb(29, 33, 41);\">-Thi công dự án, công trình</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\" />\r\n<span style=\"color: rgb(29, 33, 41);\">-Thiết Kế - Xây Dựng - Sản Xuất nội - ngoại thất theo Yêu Cầu Riêng của Quý Khách</span></span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"color: rgb(29, 33, 41);\"><a href=\"https://www.facebook.com/X%C6%B0%E1%BB%9Fng-N%E1%BB%99i-Th%E1%BA%A5t-S%C3%B4ng-%C4%90%C3%A0-1680923808876141/\">Xưởng sản xuất và Showroom</a>: B7 - R7 Ấp 2, xã Vĩnh Lộc B, H. Bình Chánh, Tp.HCM</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-