INSERT INTO `table_news` (`id`, `id_list`, `id_cat`, `id_item`, `id_sub`, `photo`, `thumb`, `ten_vi`, `ten_en`, `ten_cn`, `ten_ge`, `tenkhongdau_vi`, `tenkhongdau_en`, `tenkhongdau_cn`, `tenkhongdau_ge`, `mota_vi`, `mota_en`, `mota_cn`, `mota_ge`, `noidung_vi`, `noidung_en`, `noidung_cn`, `noidung_ge`, `title_vi`, `title_en`, `title_cn`, `title_ge`, `alt_vi`, `alt_en`, `alt_cn`, `alt_ge`, `keyword_vi`, `keyword_en`, `keyword_cn`, `keyword_ge`, `description_vi`, `description_en`, `description_cn`, `description_ge`, `h1_vi`, `h1_en`, `h1_cn`, `h1_ge`, `h2_vi`, `h2_en`, `h2_cn`, `h2_ge`, `h3_vi`, `h3_en`, `h4_vi`, `h4_en`, `h5_vi`, `h5_en`, `h6_vi`, `h6_en`, `deschar_vi`, `deschar_en`, `deschar_cn`, `deschar_ge`, `tinmoi`, `tinnoibat`, `handang`, `loaitin`, `hienthi`, `stt`, `is_index`, `is_follow`, `ngaytao`, `ngaysua`, `luotxem`, `link`, `com`) VALUES
(773, 0, 0, 0, 0, 'tips-meo-vat-giu-nha-cua-thom-tho-tu-thao-moc21213.jpg', 'tips-meo-vat-giu-nha-cua-thom-tho-tu-thao-moc21213_75x83.jpg', '[TIPS] Mẹo vặt giữ nhà cửa thơm tho từ thảo mộc', '', '', '', 'tips-meo-vat-giu-nha-cua-thom-tho-tu-thao-moc', '', '', '', 'Người ta nói rằng mùi có khả năng kích ứng mạnh và ảnh hưởng nhiều nhất tới năm giác quan của chúng ta. Trong đó, mùi hương của các loài thảo mộc, cỏ dại… đem lại sự sảng khoái, tạo suy nghĩ và giúp ngủ ngon. Dưới đây là một số loại thảo mộc không độc hại, giá cả phải chăng và dễ thực hiện giúp cho căn phòng có mùi tươi mát.', '', '', '', '<h3 style=\"box-sizing: border-box; font-family: Roboto, sans-serif; color: rgb(17, 17, 17); font-weight: bold; margin: 27px 0px 17px; font-size: 22px; line-height: 30px;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Tinh dầu</span></span></h3>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Không khí hoàn toàn được làm sạch tự nhiên từ tinh dầu, đó thật sự là điều kỳ diệu. Các loại thảo mộc như nhũ hương, thì là, bạc hà, hoắc hương… có khả năng chữa bệnh, điều trị và nâng cao tâm trạng. Công dụng của nó đã được chứng minh từ ngàn năm qua.</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><strong style=\"box-sizing: border-box;\">1.</strong>&nbsp;Cho nước vào bình xịt rỗng, và thêm một vài giọt tinh dầu mà bạn yêu thích với tỷ lệ pha loãng, lắc đều trước khi xịt. Bạn có thể thử nghiệm bằng cách kết hợp nhiều mùi hương với nhau và tạo ra mùi hương riêng biệt cho chính mình.</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><strong style=\"box-sizing: border-box;\">2.</strong>&nbsp;Đối với phòng tắm, bạn có thể tạo ra mùi hương để giữ cho phòng tắm thơm tho, sạch sẽ bằng cách nhúng một tăm bông vào tinh dầu mà bạn yêu thích và đặt nó vào phía bên trong của cuộn giấy vệ sinh một cách khéo léo! Ngoài ra, bạn có thể để một bó sả, hoặc bụi lá dứa vì chúng có khả năng tẩy mùi rất tốt.</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><strong style=\"box-sizing: border-box;\">3.</strong>&nbsp;Một số nến thơm khi mua ở cửa hàng có chứa những thành phần có hại, vì vậy thêm một vài giọt tinh dầu ô liu vào những ngọn nến sẽ giúp bạn tiết kiệm tiền và bảo vệ sức khỏe.</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><strong style=\"box-sizing: border-box;\">4.</strong>&nbsp;Trang trí nhà bằng những quả thông tẩm tinh dầu, một lọ hoa oải hương… sẽ giúp tăng hương thơm gấp đôi, thậm chí chúng còn có tính năng trang trí tự nhiên cho ngôi nhà thêm quyến rũ.</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><a href=\"http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-3.jpg\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(0, 176, 204); text-decoration-line: none;\"><img alt=\"NT251_Housekeeping010816_Giu-nha-cua-3\" class=\"lazy aligncenter size-full wp-image-593293\" data-lazy-src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-3.jpg\" data-lazy-srcset=\"http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-3.jpg 702w, http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-3-300x200.jpg 300w\" data-lazy-type=\"image\" data-pagespeed-url-hash=\"1743886238\" height=\"468\" sizes=\"(max-width: 702px) 100vw, 702px\" src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-3.jpg\" style=\"box-sizing: border-box; border-width: 0px; border-style: initial; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\" width=\"702\" /></a></span></span></p>\r\n\r\n<h3 style=\"box-sizing: border-box; font-family: Roboto, sans-serif; color: rgb(17, 17, 17); font-weight: bold; margin: 27px 0px 17px; font-size: 22px; line-height: 30px;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Xông nhà</span></span></h3>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Để giữ cho không khí trong ngôi nhà luôn sạch sẽ và không sử dụng nhiều hóa chất làm sạch, hãy thử cách đơn giản sau đây:</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Đặt một chảo nước trên lửa nhỏ và cho các loại thảo mộc, trái cây hoặc các loại gia vị yêu thích vào đun sôi. Hãy thử kết hợp một số loại thảo mộc, được yêu thích như:</span></span></p>\r\n\r\n<ol style=\"box-sizing: border-box; padding-right: 0px; padding-left: 0px; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">\r\n	<li style=\"box-sizing: border-box; line-height: 26px; margin-left: 21px;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Cam thảo lột vỏ và hương vani sẽ cho bạn một bầu không khí ngọt ngào, mùi hương dễ chịu.</span></span></li>\r\n	<li style=\"box-sizing: border-box; line-height: 26px; margin-left: 21px;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Quế, đinh hương và những cánh hoa hồng đỏ cho một mùi hương quyến rũ.</span></span></li>\r\n	<li style=\"box-sizing: border-box; line-height: 26px; margin-left: 21px;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Những lát chanh, một vài cành cây hương thảo và vani tạo nên mùi hương tươi mát.</span></span></li>\r\n</ol>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><a href=\"http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-4.jpg\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(0, 176, 204); text-decoration-line: none;\"><img alt=\"NT251_Housekeeping010816_Giu-nha-cua-4\" class=\"lazy aligncenter size-full wp-image-593292\" data-lazy-src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-4.jpg\" data-lazy-srcset=\"http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-4.jpg 702w, http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-4-200x200.jpg 200w, http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-4-300x300.jpg 300w\" data-lazy-type=\"image\" data-pagespeed-url-hash=\"1743886238\" height=\"702\" sizes=\"(max-width: 702px) 100vw, 702px\" src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT251_Housekeeping010816_Giu-nha-cua-4.jpg\" style=\"box-sizing: border-box; border-width: 0px; border-style: initial; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\" width=\"702\" /></a></span></span></p>\r\n\r\n<h3 style=\"box-sizing: border-box; font-family: Roboto, sans-serif; color: rgb(17, 17, 17); font-weight: bold; margin: 27px 0px 17px; font-size: 22px; line-height: 30px;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Tái sử dụng hoa</span></span></h3>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Thay vì vứt đi những bó hoa đã bắt đầu héo rũ, hãy tái sử dụng chúng bằng cách cho chúng vào nồi để nấu. Ngôi nhà của bạn sẽ được ướp bằng một mùi hương tuyệt vời, tinh tế.</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Cắt lấy đầu của các bông hoa cho chúng vào khay đặt trong lò nóng (khoảng 200°F) và có thể tăng mùi bằng cách thêm một số loại thảo mộc như cam, quýt cắt lát, cành thảo mộc, hoặc các loại gia vị như quế, đinh hương, tai vị… Bạn cũng có thể thêm 10-15 giọt tinh dầu yêu thích vào khay hoa và nướng trong khoảng hai giờ… hương thơm sẽ khiến bạn bất ngờ đấy.</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34); text-align: right;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><em style=\"box-sizing: border-box;\">; Phương thảo tổng hợp (Nội thất)</em></span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><em style=\"box-sizing: border-box;\">Nguồn:&nbsp;</em>noithatmagazine.vn/nha-vui/meo-vat/giu-nha-cua-thom-tho-va-sach-se-tu-thao-moc.html</span></span></p>\r\n', '', '', '', '[TIPS] Mẹo vặt giữ nhà cửa thơm tho từ thảo mộc', '', '', '', '[TIPS] Mẹo vặt giữ nhà cửa thơm tho từ thảo mộc', '', '', '', '[tips] mẹo vặt giữ nhà cửa thơm tho từ thảo mộc, ', ', ', '', '', 'Công Ty TNHH Tầm Nhìn Sông Đà, chuyên thiết kế thi công biệt thự cổ điển, thiet ke thi cong biet thu co dien, , noi that hoang gia, nội thất đế vương, noi that giac vang, thi cong noi that, thiet ke thi cong quang ninh, xay dung design by nina,', '', '', '', '[TIPS] Mẹo vặt giữ nhà cửa thơm tho từ thảo mộc', '', '', '', '[TIPS] Mẹo vặt giữ nhà cửa thơm tho từ thảo mộc', '', '', '', '[TIPS] Mẹo vặt giữ nhà cửa thơm tho từ thảo mộc', '', '[TIPS] Mẹo vặt giữ nhà cửa thơm tho từ thảo mộc', '', '[TIPS] Mẹo vặt giữ nhà cửa thơm tho từ thảo mộc', '', '[TIPS] Mẹo vặt giữ nhà cửa thơm tho từ thảo mộc', '', 244, 0, '', '', 0, 0, 0, '', 0, 17, 1, 1, 1501066597, 1514080551, 43, '', 'news'),
(774, 0, 0, 0, 0, 'hoan-thanh-ghe-cho-nha-anh-an-quan-231033.jpg', 'hoan-thanh-ghe-cho-nha-anh-an-quan-231033_75x83.jpg', 'Hoàn thành ghế cho nhà anh An [Quận 2]', '', '', '', 'hoan-thanh-ghe-cho-nha-anh-an-quan-2', '', '', '', 'Hình ảnh thi công và hình hảnh hoàn thiện sản phẩm', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'ghế nội thất', '', '', '', 'nội thất ghế gỗ', '', '', '', 'đồ gỗ nội thất', '', 'sản xuất ghế gỗ', '', 'ghế gỗ đẹp', '', '', '', 0, 0, '', '', 0, 1501466989, 0, '', 1, 100, 1, 1, 1501143975, 0, 45, '', 'hoatdongsanxuat'),
(772, 0, 0, 0, 0, 'xu-huong-noi-that-201723101.jpg', 'xu-huong-noi-that-201723101_75x83.jpg', 'Xu hướng nội thất 2017 ', '', '', '', 'xu-huong-noi-that-2017', '', '', '', 'Với nội thất, đó là phong cách cá nhân trong sự tối giản của không gian nhưng vẫn đủ sức mạnh để tôn vinh phẩm chất của từng sản phẩm cá tính thông qua kiểu dáng và vật liệu sử dụng. “Cái tôi” của người sở hữu sẽ được thể hiện và lưu giữ trong những món “trang sức” mà người đó đã chọn, trong không gian thoáng đãng và tinh tế từ bố cục cho đến màu sắc.', '', '', '', '<h5 style=\"font-weight: bold; line-height: 25px; box-sizing: border-box; font-family: Roboto, sans-serif; color: rgb(17, 17, 17); margin: 21px 0px 11px; font-size: 17px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Cùng với sự phát triển mạnh mẽ và sáng tạo không ngừng của các xu hướng nội thất trên thế giới, năm 2017 sẽ tiếp tục là năm ghi dấu sự lên ngôi của phong cách cá nhân với nhiều ý tưởng táo bạo và bay bổng.</span></h5>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\">Hằng năm, các nhà thiết kế và sản xuất nội thất trên thế giới thường bắt tay nhau trong công việc phát triển những bộ sưu tập mới dựa trên kết quả của mùa triển lãm năm trước. Các hội chợ triển lãm sẽ là một nơi nghiên cứu thị trường, sở thích và xu hướng rõ nét nhất. Dựa trên những tìm hiểu, phân tích, đánh giá ở góc độ sở thích, sự phát triển của xã hội thông qua những đối tượng là khách tham quan, đối tác, những chuyên gia thiết kế đến từ các thương hiệu sẽ phát triển ý tưởng mới và hiện thực hóa bằng các bộ sưu tập độc đáo của mình.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"nt255_xuhuong-011216_xhnt-1\" class=\"lazy aligncenter size-full wp-image-603230\" data-lazy-src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-1.jpg\" data-lazy-srcset=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-1.jpg 702w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-1-300x200.jpg 300w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-1-696x464.jpg 696w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-1-630x420.jpg 630w\" data-lazy-type=\"image\" data-pagespeed-url-hash=\"1743886238\" height=\"468\" sizes=\"(max-width: 702px) 100vw, 702px\" src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-1.jpg\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\" width=\"702\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"nt255_xuhuong-011216_xhnt-2\" class=\"lazy aligncenter size-full wp-image-603231\" data-lazy-src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-2.jpg\" data-lazy-srcset=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-2.jpg 702w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-2-300x200.jpg 300w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-2-696x464.jpg 696w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-2-630x420.jpg 630w\" data-lazy-type=\"image\" data-pagespeed-url-hash=\"1743886238\" height=\"468\" sizes=\"(max-width: 702px) 100vw, 702px\" src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-2.jpg\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\" width=\"702\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\">Quá trình tạo ra xu hướng này sẽ phụ thuộc nhiều vào tinh thần và sự nhạy cảm chủ quan của người thiết kế. Tuy nhiên, bên cạnh đó, họ vẫn cân bằng các giá trị dựa trên sự kết hợp những thấu hiểu về lối sống và văn hóa tiêu dùng của thị trường mục tiêu để các sản phẩm nghệ thuật ra đời vẫn hội đủ các tiềm năng thương mại. Đôi lúc, họ chỉ đơn thuần tái sử dụng các mẫu quen thuộc nhưng chuyển tải thông điệp trong một ý tưởng hoàn toàn mới. Các chuyên gia này không chỉ là những người thiết kế các sản phẩm nội thất mà còn là người kiến tạo nên không gian nội thất, thông qua đó xây dựng nên phong cách và giá trị sống.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"nt255_xuhuong-011216_xhnt-3\" class=\"lazy aligncenter size-full wp-image-603232\" data-lazy-src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-3.jpg\" data-lazy-srcset=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-3.jpg 702w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-3-300x200.jpg 300w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-3-696x464.jpg 696w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-3-630x420.jpg 630w\" data-lazy-type=\"image\" data-pagespeed-url-hash=\"1743886238\" height=\"468\" sizes=\"(max-width: 702px) 100vw, 702px\" src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-3.jpg\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\" width=\"702\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"nt255_xuhuong-011216_xhnt-4\" class=\"lazy aligncenter size-full wp-image-603233\" data-lazy-src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-4.jpg\" data-lazy-srcset=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-4.jpg 702w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-4-300x200.jpg 300w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-4-696x464.jpg 696w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-4-630x420.jpg 630w\" data-lazy-type=\"image\" data-pagespeed-url-hash=\"1743886238\" height=\"468\" sizes=\"(max-width: 702px) 100vw, 702px\" src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-4.jpg\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\" width=\"702\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\">CEO Phạm Cao Đông, một người có hơn 20 năm kinh nghiệm trong lĩnh vực nội thất đã dự đoán rằng những thiết kế hiện đại có âm hưởng từ lối sống bay bổng của bán cổ điển sẽ là điểm nhấn cho xu hướng nội thất năm 2017. Theo phân tích của ông, hiện nay thị trường tiêu thụ khổng lồ không còn nằm ở châu Âu hay Mỹ mà đã chuyển hướng về châu Á với sức mua ngày càng tăng cao. “Chính thị trường mới này sẽ tạo cảm hứng mới cho các nhà thiết kế và tôi sẽ không bất ngờ khi các đặc trưng văn hóa châu Á sẽ hiển hiện trong các bộ sưu tập nội thất lừng danh trên thế giới. Đó là sự cộng hưởng giữa người thiết kế và người tiêu dùng, đó là một sức mạnh đến từ song phương!”.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"nt255_xuhuong-011216_xhnt-5\" class=\"lazy aligncenter size-full wp-image-603234\" data-lazy-src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-5.jpg\" data-lazy-srcset=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-5.jpg 702w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-5-300x200.jpg 300w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-5-696x464.jpg 696w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-5-630x420.jpg 630w\" data-lazy-type=\"image\" data-pagespeed-url-hash=\"1743886238\" height=\"468\" sizes=\"(max-width: 702px) 100vw, 702px\" src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-5.jpg\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\" width=\"702\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"nt255_xuhuong-011216_xhnt-6\" class=\"lazy aligncenter size-full wp-image-603235\" data-lazy-src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-6.jpg\" data-lazy-srcset=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-6.jpg 702w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-6-300x200.jpg 300w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-6-696x464.jpg 696w, http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-6-630x420.jpg 630w\" data-lazy-type=\"image\" data-pagespeed-url-hash=\"1743886238\" height=\"468\" sizes=\"(max-width: 702px) 100vw, 702px\" src=\"http://www.noithatmagazine.vn/wp-content/uploads/NT255_XuHuong-011216_XHNT-6.jpg\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\" width=\"702\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\">Trong hơn một thập niên trở lại đây, dấu ấn cá nhân ngày càng được thể hiện rõ nét hơn bao giờ hết trong nội thất nói riêng và những lĩnh vực nghệ thuật, đời sống nói chung. Với nội thất, đó là phong cách cá nhân trong sự tối giản của không gian nhưng vẫn đủ sức mạnh để tôn vinh phẩm chất của từng sản phẩm cá tính thông qua kiểu dáng và vật liệu sử dụng. “Cái tôi” của người sở hữu sẽ được thể hiện và lưu giữ trong những món “trang sức” mà người đó đã chọn, trong không gian thoáng đãng và tinh tế từ bố cục cho đến màu sắc.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: rgb(34, 34, 34);\"><span style=\"font-family:arial,helvetica,sans-serif;\">Nguồn:&nbsp;noithatmagazine.vn/song/xu-huong/xu-huong-noi-2017-va-su-len-ngoi-cua-phong-cach-ca-nhan.html</span></p>\r\n', '', '', '', 'Xu hướng nội thất 2017 ', '', '', '', 'Xu hướng nội thất 2017 ', '', '', '', 'Xu hướng nội thất 2017 ', '', '', '', 'Công Ty TNHH Tầm Nhìn Sông Đà, chuyên thiết kế thi công biệt thự cổ điển, thiet ke thi cong biet thu co dien, , noi that hoang gia, nội thất đế vương, noi that giac vang, thi cong noi that, thiet ke thi cong quang ninh, xay dung design by nina,', '', '', '', 'xu hướng nội thất 2017', '', '', '', 'thiết kế nội thất 2017', '', '', '', 'ý tưởng nội thất 2017', '', 'nội thất đẹp ', '', 'nội thất thể hiện cá tính', '', 'nội thất 2017', '', 244, 0, '', '', 0, 0, 0, '', 1, 16, 1, 1, 1501066407, 1514080583, 53, '', 'news'),
