(778, 0, 0, 0, 0, 'hay-cho-tre-mot-cot-song-vung-chac31323.jpg', 'hay-cho-tre-mot-cot-song-vung-chac31323_75x83.jpg', 'Hãy cho trẻ một cột sống vững chắc', '', '', '', 'hay-cho-tre-mot-cot-song-vung-chac', '', '', '', 'Chúng tôi thực hiện chến dịch này với mong muốn góp phần ngăn chặn tỷ lệ trẻ từ 6 tuổi đến 10 tuổi gù lưng, cận thị.', '', '', '', '<p><span style=\"font-size:16px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"color: rgb(29, 33, 41);\">Bạn có biết Bệnh gù lưng là một bệnh rất phổ biến trong giai đoạn hiện nay, đó là tình trạng cột sống bị uốn cong sang bên phải hoặc bên trái.&nbsp;</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px;\" />\r\n<span style=\"color: rgb(29, 33, 41);\">Các bậc cha mẹ cần phải quan tâm đến con trong những tác động dù là nhỏ nhất từ cuộc sống hàng ngày, từ những chiếc cặp trên lưng con hay là tư thế ngồi học của con.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:times new roman,times,serif;\"><span aria-live=\"polite\" class=\"fbPhotosPhotoCaption\" data-ft=\"{\" tn=\"\"><span class=\"hasCaption\">Nếu đây là điều bạn đang trăn trở, hãy liên hệ&nbsp;ngay cho chúng tôi để được tư vấn, báo giá tốt nhất trong dịp tựu trường này.</span></span><span class=\"fbPhotoTagList\" id=\"fbPhotoSnowliftTagList\" style=\"display: inline; line-height: 18px; color: rgb(29, 33, 41);\"><span class=\"fcg\" style=\"color: rgb(144, 148, 156);\">&nbsp;</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"color: rgb(29, 33, 41);\">Hãy để chúng tôi cùng bạn kiến tạo tương lai vững chắc cho gia đình bạn.</span></span></span></p>\r\n\r\n<p><img alt=\"desk\" src=\"/upload/images/collage%20desk.jpg\" style=\"width: 1200px; height: 924px;\" /></p>\r\n\r\n<p><span style=\"font-family:times new roman,times,serif;\"><span style=\"font-size:16px;\">Chúng tôi thực hiện chến dịch này với mong muốn&nbsp;góp phần&nbsp;ngăn chặn tỷ lệ trẻ từ 6 tuổi đến 10 tuổi&nbsp;gù lưng, cận thị.</span></span></p>\r\n\r\n<p><span style=\"font-family:times new roman,times,serif;\"><span style=\"font-size:16px;\">Chiến dịch: Do not limit kid vision</span></span></p>\r\n\r\n<p><span style=\"font-family:times new roman,times,serif;\"><span style=\"font-size:16px;\"><img alt=\"Do not limit kid vision\" src=\"/upload/images/do%20not%20limit%20kid%20vision%201.jpg\" style=\"width: 960px; height: 640px;\" /></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Do not limit kid vision\" src=\"/upload/images/do%20not%20limit%20kid%20vision%206.jpg\" style=\"width: 852px; height: 480px;\" /><img alt=\"Do not limit kid vision\" src=\"/upload/images/do%20not%20limit%20kid%20vision%204.jpg\" style=\"width: 476px; height: 329px;\" /></p>\r\n\r\n<p><img alt=\"Do not limit kid vision\" src=\"/upload/images/do%20not%20limit%20kid%20vision%202.jpg\" style=\"width: 640px; height: 360px;\" /></p>\r\n\r\n<p><img alt=\"Do not limit kid vision\" src=\"/upload/images/do%20not%20limit%20kid%20vision%203(1).jpg\" style=\"width: 455px; height: 327px;\" /></p>\r\n\r\n<p><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 20px; text-align: center;\">Hãy cho trẻ một cột sống vững chắc</span></p>\r\n', '', '', '', 'Công Ty TNHH Tầm Nhìn Sông Đà, chuyên thiết kế thi công biệt thự cổ điển, thiet ke thi cong biet thu co dien, , noi that hoang gia, nội thất đế vương, noi that giac vang, thi cong noi that, thiet ke thi cong quang ninh, xay dung design by nina', '', '', '', 'Công Ty TNHH Tầm Nhìn Sông Đà, chuyên thiết kế thi công biệt thự cổ điển, thiet ke thi cong biet thu co dien, , noi that hoang gia, nội thất đế vương, noi that giac vang, thi cong noi that, thiet ke thi cong quang ninh, xay dung design by nina', '', '', '', 'Công Ty TNHH Tầm Nhìn Sông Đà, chuyên thiết kế thi công biệt thự cổ đ