(779, 0, 0, 0, 0, 'hoan-thien-ban-ghe-co-dien-thu-duc33030.jpg', 'hoan-thien-ban-ghe-co-dien-thu-duc33030_75x83.jpg', 'Hoàn thiện bàn ghế cổ điển [THỦ ĐỨC]', '', '', '', 'hoan-thien-ban-ghe-co-dien-thu-duc', '', '', '', 'Mẫu bàn ghế Cổ Điển này cho biệt thự nhà anh Chín ở Thủ Đức.\r\n\r\nNội thất phong cách cổ điển\r\n\r\nChất liệu: Gỗ, chi tiết dát vàng\r\n\r\nGiá + Chi tiết: Liên hệ trực tiếp \r\n', '', '', '', '<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">&nbsp;Nhắc đến phong cách Cổ Điển thì tính hàng lối, đối xứng, tỉ mỉ, sang trọng luôn được nói đến đầu tiên. Nguồn gốc xuất phát từ phong cách thiết kế đối xứng và long trọng của La Mã Hy Lạp cổ đại pha trộn với phong cách nghệ thuật nội thất của Pháp thế kỉ 18. Tạo nên nét đẹp hài hòa, tinh tế cho các sản phẩm nội thất đi theo phong cách này. Đặc điểm nội thất Cổ Điển gồm những yếu tố:</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Tính hàng lối, đối xứng, tỉ mỉ</span></span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li value=\"2\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Chất liệu</span></span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li value=\"3\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Luôn có một chủ thể nổi bật giữa căn phòng</span></span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li value=\"4\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Màu sắc hài hòa</span></span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li value=\"5\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Ánh sáng</span></span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Với những đặc thù như trên, rất nhiều gia chủ mong muốn sở hữu cho mình một ngôi nhà có đẳng cấp sang trọng như vậy nhưng chưa thể quyết định được mẫu thiết kế nào, đầu tư những gì, nên chọn tông màu thế nào… để cố thể mang được toàn bộ vẻ đẹp của concept Cổ Điển này đến ngôi nhà mình.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Qua gói dịch vụ Tư Vấn – Thiết Kế - Sản Xuất, xưởng đồ gỗ Nội Thất của công ty Tầm nhìn sông Đà trở thành đơn vị tư vấn mẫu bàn ghế Cổ Điển này cho biệt thự nhà anh Chín ở Thủ Đức.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"nội thất cổ điển\" src=\"/upload/images/b%E1%BB%99%20b%C3%A0n%20gh%E1%BA%BF%20c%E1%BB%95%20%C4%91i%E1%BB%83n.jpg\" style=\"width: 1200px; height: 912px;\" /></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', 'Hoàn thiện bàn ghế cổ điển', '', '', '', 'Hoàn thiện bàn ghế cổ điển', '', '', '', 'hoàn thiện bàn ghế cổ điển, ', ', ', '', '', 'Mẫu bàn ghế Cổ Điển này cho biệt thự nhà anh Chín ở Thủ Đức.\r\n\r\nNội thất phong cách cổ điển\r\n\r\nChất liệu: Gỗ, chi tiết dát vàng\r\n\r\nGiá + Chi tiết: Liên hệ trực tiếp \r\n', '', '', '', 'Hoàn thiện bàn ghế cổ điển', '', '', '', 'Hoàn thiện bàn ghế cổ điển', '', '', '', 'Hoàn thiện bàn ghế cổ điển', '', 'Hoàn thiện bàn ghế cổ điển', '', 'Hoàn thiện bàn ghế cổ điển', '', 'Hoàn thiện bàn ghế cổ điển', '', 160, 0, '', '', 0, 1502962667, 0, '', 1, 103, 1, 1, 1502878849, 0, 110, '', 'hoatdongsanxuat'),
(781, 0, 0, 0, 0, 'hoan-thien-tu-khung-giuong-biet-thu-nha-anh-long-quan-231133.png', 'hoan-thien-tu-khung-giuong-biet-thu-nha-anh-long-quan-231133_75x83.png', 'Hoàn thiện nội thất phòng ngủ Biệt thự nhà anh Long [QUẬN 2]', '', '', '', 'hoan-thien-noi-that-phong-ngu-biet-thu-nha-anh-long-quan-2', '', '', '', '-Tủ đầu giường + Khung giường theo phong cách Cổ Điển\r\n\r\n-Chất liệu Gỗ, dát vàng\r\n\r\n-Giá + Chi tiết: Liên hệ', '', '', '', '<p><img alt=\"Nội thất cổ điển\" src=\"/upload/images/tu%20dau%20giuong%201a.png\" style=\"width: 400px; height: 400px;\" /></p>\r\n\r\n<p><img alt=\"nội thất cổ điển\" src=\"/upload/images/dau%20giuong.png\" style=\"width: 400px; height: 400px;\" /></p>\r\n', '', '', '', 'Hoàn thiện tủ + khung giường', '', '', '', 'Hoàn thiện tủ + khung giường', '', '', '', 'hoàn thiện tủ + khung giường, ', ', ', '', '', '-Nội thất phong cách Cổ Điển\r\n\r\n-Chất liệu Gỗ, dát vàng\r\n\r\n-Giá + Chi tiết: Liên hệ', '', '', '', 'Hoàn thiện tủ + khung giường', '', '', '', 'Hoàn thiện tủ + khung giường', '', '', '', 'Hoàn thiện tủ + khung giường', '', 'Hoàn thiện tủ + khung giường', '', 'Hoàn thiện tủ + khung giường', '', 'Hoàn thiện tủ + khung giường', '', 79, 0, '', '', 0, 1502962665, 0, '', 1, 104, 1, 1, 1502962564, 1502962791, 49, '', 'hoatdongsanxuat'),
(783, 0, 0, 0, 0, 'tranh-ca-chep30102.png', 'tranh-ca-chep30102_75x83.png', 'Tranh Cá Chép', '', '', '', 'tranh-ca-chep', '', '', '', 'Chi tiết + Báo giá: vui lòng liên hệ', '', '', '', '<p><span style=\"color:#FFFFFF;\"><img alt=\"lý ngư vọng nguyệt\" src=\"/upload/images/z762467982022_679ac20860e431ddfa74238e2b619020.png\" style=\"width: 720px; height: 960px;\" /></span></p>\r\n\r\n<blockquote>\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">\"Lý Ngư Vọng Nguyệt\" (Cá Chép Trông Trăng):&nbsp;Hãy tìm về sự hoàn thiện, viên mãn của con người.</span></span></span></p>\r\n</blockquote>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><strong>Vẻ đẹp hình tượng:</strong>&nbsp;toát lên ngay từ hình tượng độc đáo với một bố cục rất ấn tượng nhưng hài hòa và cân đối. Nhưng chính biểu tượng của bức tranh đã làm nên sự vi diệu, sâu lắng và sự minh triết trong bức tranh này.&nbsp;</span></span></span><br helvetica=\"\" neue=\"\" style=\"color: rgb(0, 0, 0); font-family: \" />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><strong>Cá chép</strong> là loài cá nước ngọt rất phổ biến, theo truyền thuyết nó được lựa chọn làm biểu tượng cho ý thức vươn lên trong cuộc sống : loài cá ứng cử cho đẳng cấp cao nhất trong vũ trụ là Rồng.&nbsp;<br helvetica=\"\" neue=\"\" style=\"color: rgb(0, 0, 0); font-family: \" />\r\nHình tượng cá chép trong tranh kết hợp với một hình tượng qui ước làm nên tính minh triết của bức tranh. Đó chính là mặt trăng và bóng trăng soi đáy nước.&nbsp;</span></span></span><br helvetica=\"\" neue=\"\" style=\"color: rgb(0, 0, 0); font-family: \" />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Trên thực tế, không có bóng trăng soi đáy nước, mà chỉ có<strong> bóng trăng soi mặt nước</strong>. Bóng trăng soi đáy nước trong tranh này là một hình tượng qui ước. Hình tượng bóng trăng đáy nước là biểu tượng cho ảo ảnh của một giá trị đích thực được biểu tượng bằng mặt trăng trên không gian.&nbsp;<br helvetica=\"\" neue=\"\" style=\"color: rgb(0, 0, 0); font-family: \" />\r\nHình tròn của mặt trăng là biểu tượng của sự hoàn thiện, viên mãn đích thực. Nhưng con cá chép trong tranh lại không tìm về giá trị đích thực, mà lại tìm những ảo ảnh của cuộc đời.&nbsp;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><strong>Vẻ đẹp kỹ thuật:</strong></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"tính đối xứng\" src=\"/upload/images/ty%20le%20ca%20vang.jpg\" style=\"width: 400px; height: 355px;\" /></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Hình ảnh con cá được đo vẽ theo tỷ lệ vàng như những tác phẩm nghệ thuật nổi tiếng khác như Mona Lisa, đền Pantheon,...</span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Tính đối xứng của nền mỹ thuật mỹ cổ điển chính là điểm đắc giá khiến bức tranh Lý Ngư Vọng Nguyệt đạt mức tuyệt tác, trường tồn theo thời gian.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Ví dụ về Tỷ Lệ Vàng:</span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"tỷ lệ vàng\" src=\"/upload/images/ty-le-vang-trong-hoi-hoa.jpg\" style=\"width: 1000px; height: 478px;\" /></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', 'Tranh Cá Chép', '', '', '', 'Tranh Cá Chép', '', '', '', 'tranh cá chép, ', ', ', '', '', '', '', '', '', 'Tranh Cá Chép', '', '', '', 'Tranh Cá Chép', '', '', '', 'Tranh Cá Chép', '', 'Tranh Cá Chép', '', 'Tranh Cá Chép', '', 'Tranh Cá Chép', '', 0, 0, '', '', 0, 1504861598, 0, '', 1, 7, 1, 1, 1504861565, 1504861705, 64, '', 'bosuutap'),
(784, 0, 0, 0, 0, 'hoan-thien-buc-tranh-ly-ngu-vong-nguyet-nha-anh-tuan-quan-920322.png', 'hoan-thien-buc-tranh-ly-ngu-vong-nguyet-nha-anh-tuan-quan-920322_75x83.png', 'Hoàn thiện bức tranh Lý Ngư Vọng Nguyệt nhà anh Tuấn [QUẬN 9]', '', '', '', 'hoan-thien-buc-tranh-ly-ngu-vong-nguyet-nha-anh-tuan-quan-9', '', '', '', '\"Lý Ngư Vọng Nguyệt\" (Cá Chép Trông Trăng): Hãy tìm về sự hoàn thiện, viên mãn của con người.. Chi tiết + Báo giá: vui lòng liên hệ ', '', '', '', '<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Bức trang Lý Ngư Vọng Nguyệt, tầm nhìn sông Đà đã từng chi sẻ về ý nghĩ cũng như công dụng của tại <a href=\"http://tamnhinsongda.com/bo-suu-tap/tranh-ca-chep-783.html\">đây</a>.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Được sự theo dõi của anh Tuán, Tầm nhìn sông Đà hân hạnh trở thành đơn vị thi công sản phẩm nội thất tinh túy này.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"nội thất phong thủy đẹp\" src=\"/upload/images/cd50f06b3d63d13d8872.png\" style=\"width: 719px; height: 960px;\" /></span></span></p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Hình ảnh hoàn thiện của sản phẩm.</span></span></p>\r\n', '', '', '', 'Lý Ngư Vọng Nguyệt ', '', '', '', 'Lý Ngư Vọng Nguyệt ', '', '', '', 'Lý Ngư Vọng Nguyệt ', '', '', '', 'Lý Ngư Vọng Nguyệt ', '', '', '', 'Lý Ngư Vọng Nguyệt ', '', '', '', 'Lý Ngư Vọng Nguyệt ', '', '', '', 'Lý Ngư Vọng Nguyệt ', '', 'Lý Ngư Vọng Nguyệt ', '', 'Lý Ngư Vọng Nguyệt ', '', 'Lý Ngư Vọng Nguyệt ', '', 19, 0, '', '', 0, 1505293346, 0, '', 1, 106, 1, 1, 1505293341, 0, 46, '', 'hoatdongsanxuat'),
(785, 0, 0, 0, 0, 'hoan-thien-ban-tho-nha-anh-lam-quan-thu-duc13020.png', 'hoan-thien-ban-tho-nha-anh-lam-quan-thu-duc13020_75x83.png', 'Hoàn thiện bàn thờ nhà anh Lâm [QUẬN THỦ ĐỨC]', '', '', '', 'hoan-thien-ban-tho-nha-anh-lam-quan-thu-duc', '', '', '', 'Người Việt Nam trước nay bên cạnh đời sống hằng ngày còn rất quan tâm đến đời sống tâm linh. Đó là cũng là thể hiện nên tinh thần dân tộc lâu đời Uống nước nhớ nguồn, không bao giờ quên nguồn cội. Chi tiết + Báo giá: vui lòng liên hệ', '', '', '', '<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Người Việt Nam trước nay bên cạnh đời sống hằng ngày còn rất quan tâm đến đời sống tâm linh. Đó là cũng là thể hiện nên tinh thần dân tộc lâu đời Uống nước nhớ nguồn, không bao giờ quên nguồn cội.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Tầm nhìn sông Đà trở thành đơn vị thiết kế và thi công bàn thờ cho gia đình nhà anh Lâm, quận Thủ Đức.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Nhìn chung, các gia đình đều muốn bố trí phòng thờ theo xu hướng vừa kế thừa yếu tố truyền thống vừa linh hoạt theo xu hướng hiện đại để không gian này vừa tiện dụng lại vừa thân thiện với nhiều thế hệ khác nhau những vẫn giữ được sự trang nghiêm cần thiết của phòng thờ.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Như bàn thờ này, Tầm nhìn sông Đà muốn biến đó thành&nbsp;điểm sáng&nbsp;của giang phòng.&nbsp;Với màu vàng kim loại làm chủ đạo, đế gỗ sơn đen, cùng chữ sơn đen tạo độ tương phản về màu sắc.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"nội thất đẹp\" src=\"/upload/images/15e99e8c5384bfdae695.png\" style=\"width: 960px; height: 720px;\" /></span></span></p>\r\n', '', '', '', 'Hoàn thiện bàn thờ ', '', '', '', 'Hoàn thiện bàn thờ ', '', '', '', 'Hoàn thiện bàn thờ ', '', '', '', 'Hoàn thiện bàn thờ ', '', '', '', 'Hoàn thiện bàn thờ ', '', '', '', 'Hoàn thiện bàn thờ ', '', '', '', 'Hoàn thiện bàn thờ ', '', 'Hoàn thiện bàn thờ ', '', 'Hoàn thiện bàn thờ ', '', 'Hoàn thiện bàn thờ ', '', 19, 0, '', '', 0, 1505293892, 0, '', 1, 107, 1, 1, 1505293889, 0, 67, '', 'hoatdongsanxuat');
