(786, 0, 0, 0, 0, 'hoan-thien-tuong-quan-cong11020.png', 'hoan-thien-tuong-quan-cong11020_75x83.png', 'Hoàn thiện tượng Quan Công ', '', '', '', 'hoan-thien-tuong-quan-cong', '', '', '', 'Chi tiết + Báo giá: vui lòng liên hệ', '', '', '', '<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"text-align: justify;\"><strong>Ý nghĩa phong thủy của tượng Quan công</strong></span><br style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 16px; text-align: justify;\" />\r\n<br style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 16px; text-align: justify;\" />\r\n<span style=\"text-align: justify;\">Quan công luôn xuất hiện với hình ảnh khí khái mãnh liệt, gương mặt cương quyết có phần dữ dằn, mặt đỏ và dâu dài, trên tay luôn cầm long đao trong tư thế sẵn sàng. Người ta quan niệm rằng Tượng Quan Công có gương mặt càng dữ thì hiệu quả bảo vệ càng mạnh.&nbsp;</span></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"text-align: justify;\"><img alt=\"tượng quan công\" src=\"/upload/images/2(11).png\" style=\"width: 720px; height: 960px;\" /></span></span></span></span><br style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 16px; text-align: justify;\" />\r\n&nbsp;</p>\r\n\r\n<ul style=\"padding-right: 0px; overflow: hidden; color: rgb(34, 34, 34); font-family: Arial; font-size: 16px; text-align: justify; margin: 5px 0px !important; padding-left: 2em !important; list-style-position: outside !important; list-style-image: initial !important;\">\r\n	<li style=\"margin: 0px !important; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px !important; list-style: disc outside !important;\"><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"line-height: 2em; background-color: initial;\">Với những hướng nhà xấu ảnh hưởng tới gia chủ thì nên dùng tượng Quan Công trấn giữ ở cửa, quay mặt ra hướng chính diện của cửa lớn. Đối với những hướng nhà bị sao xấu chiếu tới cũng dùng tượng quan công để chế hóa.</span></span></span></span></li>\r\n	<li style=\"margin: 0px !important; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px !important; list-style: disc outside !important;\"><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"line-height: 2em; background-color: initial;\">Với những người làm chức lớn hay có tầm quan trọng trong kinh doanh, chính trị hoặc các tổ chức sẽ thường xuyên gặp phải những người đố kị chơi xấu, thường xuyên dùng âm mưu thủ đoạn để hãm hại. Do đó người ta tin rằng các nhà lãnh tụ và doanh nhân khi đạt Quan Công sau lưng, tại nơi làm việc, họ sẽ luôn nhận đươc sự hỗ trợ mạnh mẽ để chống lại những thế lực đang làm ảnh hưởng đến họ.&nbsp;</span></span></span></span></li>\r\n	<li style=\"margin: 0px !important; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px !important; list-style: disc outside !important;\"><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"line-height: 2em; background-color: initial;\">Để Trấn hạch nên đặt ở chính giữa hướng nhìn thẳng ra cửa ra vào hoặc ở các vị trí Sát tinh chiếu như: hoạ hại, lục sát, ngũ quỷ, tuyệt mệnh…Trong trường hợp nhà hướng Chính Bắc, Tây Bắc, Chính Tây có thể bày ở trung tâm của căn nhà hoặc căn phòng.</span></span></span></span></li>\r\n	<li style=\"margin: 0px !important; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px !important; list-style: disc outside !important;\"><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"line-height: 2em; background-color: initial;\">Để cầu tài, người Trung quốc thường thờ Quan Công với ý nghĩa ngài sẽ mang lại cho gia đình nhiều tài lộc, công việc làm ăn kinh doanh thuận lợi, dẹp trừ tiểu nhân.</span></span></span></span></li>\r\n	<li style=\"margin: 0px !important; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px !important; list-style: disc outside !important;\"><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"line-height: 2em; background-color: initial;\">Cấm kị đặt tượng ở những nơi như phòng ngủ, phòng bếp hay nhà vệ sinh, những nơi không trang nghiêm, tĩnh tại phạm bất kính.</span></span></span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"color:#FFFFFF;\">Khách hàng có thể tham khảo thêm tượng Quan Công tại </span><a href=\"http://tamnhinsongda.com/bo-suu-tap/tuong-quan-cong-787.html\"><span style=\"color:#FFFFFF;\">đây</span></a><span style=\"color:#FFFFFF;\">.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><u><span style=\"color:#FFFFFF;\">http://tamnhinsongda.com/bo-suu-tap/tuong-quan-cong-787.html</span></u></p>\r\n', '', '', '', 'Tượng Quan Vũ cầm Thanh Long Đao', '', '', '', 'Tượng Quan Vũ cầm Thanh Long Đao', '', '', '', 'tượng quan vũ cầm thanh long đao, ', ', ', '', '', 'Chi tiết + Báo giá: vui lòng liên hệ', '', '', '', 'Tượng Quan Vũ cầm Thanh Long Đao', '', '', '', 'Tượng Quan Vũ cầm Thanh Long Đao', '', '', '', 'Tượng Quan Vũ cầm Thanh Long Đao', '', 'Tượng Quan Vũ cầm Thanh Long Đao', '', 'Tượng Quan Vũ cầm Thanh Long Đao', '', 'Tượng Quan Vũ cầm Thanh Long Đao', '', 36, 0, '', '', 0, 1505533333, 0, '', 1, 108, 1, 1, 1505533319, 1505721090, 79, '', 'hoatdongsanxuat'),
(787, 0, 0, 0, 0, 'tuong-quan-cong13011.png', 'tuong-quan-cong13011_75x83.png', 'Tượng Quan Công ', '', '', '', 'tuong-quan-cong', '', '', '', 'Chi tiết + Báo giá: vui lòng liên hệ', '', '', '', '<p><span style=\"text-align: justify;\"><span style=\"color:#FFFFFF;\"><font face=\"Arial\"><span style=\"font-size: 16px;\"><b>L</b></span></font></span><font color=\"#ffffff\" face=\"times new roman, times, serif\"><span style=\"font-size: 18px;\">là tên thật của Quan Vũ, tự là Trương Sinh sau đổi thành Vân Trường người làng Giải Lương tỉnh Hà Đông, Trung Quốc. Là một nhân vật lịch sử Trung Quốc được biết đến nhiều nhất ở khu vực Đông&nbsp; Nam Á đặc biệt là trong các đền đài và gia đình Người Hoa. Dân gian xem ông như một biểu tượng của tính hào hiệp, trượng nghĩa và trung thành, luôn chống lại kẻ ác và sẵn sàng bảo vệ những người bị áp bức.</span></font></span></p>\r\n\r\n<p><br style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 16px; text-align: justify;\" />\r\n<span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"text-align: justify;\">Nhân Vật Quan Công cũng được hình tượng hóa trong tác phẩm Tam Quốc Diễn nghĩa của La Hán Trung, sau này được chuyển thể qua nhiều dạng loại hình nghệ thuật khác. Ngày nay tượng quan công được thờ phụng trong nhà như một vị thánh chuyên trấn áp hung khí, chống tà ma ngoại đạo.&nbsp;</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"nội thất đế vương\" src=\"/upload/images/3a166c65d1713d2f6460(1).png\" style=\"width: 720px; height: 960px;\" /></span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Tượng Quan công với tướng đứng hùng dùng trên tay cẩm thanh đao, gương mặt cương nghị thể hiện khí khái anh hùng không thể dễ dàng khuất phục, không những dùng để trang trí mà còn góp phần tạo nên sự uy nghiêm, trang trọng cho căn phòng của bạn.&nbsp;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><img alt=\"nội thất đế vương\" src=\"/upload/images/d64644b0f8a414fa4db5.png\" style=\"width: 720px; height: 960px;\" /></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Tượng Quan Công đọc sách: &nbsp;xuất phát từ tích Quan Công được Tào Tháo sắp xếp ở với hai chị dâu vợ của Lưu Bị với âm mưu dựa vào sắc đẹp của 2 nàng Nhị Kiều hy vọng Quan Công không giữ được mình mà làm những điều không phải. Ngờ đâu Quan Công lấy đuốc ra đốt và đọc sách \"Xuân Thu\" khiến Tào Tháo vô cùng cảm phục. Về sau truyện đó được lưu truyền trong dân gian và người ta lấy hình tượng đó để thờ về đức tính trung thành, quả quyết không dễ dàng bị lay động.</span></span></span></p>\r\n\r\n<p><span style=\"color: rgb(255, 255, 255); font-family: &quot;times new roman&quot;, times, serif; font-size: 18px; text-align: justify;\">Chi tiết + Báo giá: vui lòng liên hệ</span></p>\r\n', '', '', '', 'Tượng Quan Công ', '', '', '', 'Tượng Quan Công ', '', '', '', 'tượng quan công , ', ', ', '', '', 'Chi tiết + Báo giá: vui lòng liên hệ', '', '', '', 'Tượng Quan Công ', '', '', '', 'Tượng Quan Công ', '', '', '', 'Tượng Quan Công ', '', 'Tượng Quan Công ', '', 'Tượng Quan Công ', '', 'Tượng Quan Công ', '', 36, 0, '', '', 0, 1505533534, 0, '', 1, 8, 1, 1, 1505533516, 1505705540, 73, '', 'bosuutap'),
(788, 0, 0, 0, 0, 'tuong-phuc-loc-tho21001.png', 'tuong-phuc-loc-tho21001_75x83.png', 'Tượng Phúc Lộc Thọ', '', '', '', 'tuong-phuc-loc-tho', '', '', '', 'Chi tiết + Báo giá: vui lòng liên hệ', '', '', '', '<p style=\"border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 1.6; font-family: Tahoma, serif; font-size: 15px; margin: 0px 0px 15px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(68, 68, 68); text-align: justify;\"><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Tượng Phúc Lộc Thọ (hay còn gọi là Tam Đa), được xem là biểu tượng cho 3 niềm hạnh phúc lớn nhất đời người: Hạnh Phúc, Giàu Có, Khỏe Mạnh.</span></span></span></span></p>\r\n\r\n<p style=\"border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 1.6; font-family: Tahoma, serif; font-size: 15px; margin: 0px 0px 15px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(68, 68, 68); text-align: justify;\"><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Rất nhiều gia đình chọn 3 vị thần này làm thần may mắn, mang đến tài lộc cho gia đình với mong muốn được an bình, hạnh phúc, thịnh vượng.</span></span></span></span></p>\r\n\r\n<p style=\"border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 1.6; font-family: Tahoma, serif; font-size: 15px; margin: 0px 0px 15px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(68, 68, 68); text-align: justify;\"><span style=\"color:#FFFFFF;\"><span