"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"border: 0px; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Xưởng sản xuất trực tiếp của Tầm nhìn sông Đà luôn chú trọng đến từng tiểu tiết trong các sản phẩm, từng đường khắc, từng điểm gờ. Mọi sản phẩm đều đặt rất nhiều tâm huyết để đạt được độ hào lòng cao nhất nơi khách hàng.</span></span></span></span></p>\r\n\r\n<p style=\"border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 1.6; font-family: Tahoma, serif; font-size: 15px; margin: 0px 0px 15px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(68, 68, 68); text-align: justify;\"><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Chi tiết + Báo giá: vui lòng liên hệ</span></span></span></p>\r\n', '', '', '', 'Tượng Phúc Lộc Thọ', '', '', '', 'Tượng Phúc Lộc Thọ', '', '', '', 'tượng phúc lộc thọ, _e_0c1h', ', _e_0c1h', '', '', 'Chi tiết + Báo giá: vui lòng liên hệ', '', '', '', 'Tượng Phúc Lộc Thọ', '', '', '', 'Tượng Phúc Lộc Thọ', '', '', '', 'Tượng Phúc Lộc Thọ', '', 'Tượng Phúc Lộc Thọ', '', 'Tượng Phúc Lộc Thọ', '', 'Tượng Phúc Lộc Thọ', '', 36, 0, '', '', 0, 1505705462, 0, '', 1, 9, 1, 1, 1505705442, 1505705513, 57, '', 'bosuutap'),
(789, 0, 0, 0, 0, 'tuong-phat-di-lac31100.png', 'tuong-phat-di-lac31100_75x83.png', 'Tượng Phật Di Lặc', '', '', '', 'tuong-phat-di-lac', '', '', '', 'Chi tiết + Báo giá: vui lòng liên hệ', '', '', '', '<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><em><strong>Phật Di Lặc</strong></em> là một trong những biểu tượng độc đáo trong Phật Giáo, là vị Phật thứ 5 sau Phật Thích Ca Mâu Ni nhưng người lại không mang dáng vẻ trầm mặc, uy nghiêm của các vị Phật Khác.</span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><img alt=\"tượng phật Di Lặc\" src=\"/upload/images/3(6).png\" style=\"width: 600px; height: 800px;\" /></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Thay vào đó là một sự tươi vui phấn khởi, nụ cười tươi vui yêu đời, thân hình mập mạp chân chất mà thân quen. Cùng tìm hiểu những điều nên và không nên khi đặt tượng Phật Di Lặc trong nhà để mang lại may mắn và bình an nhé.</span></span></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><img alt=\"tượng Di Lặc\" src=\"/upload/images/2(10).png\" style=\"width: 600px; height: 800px;\" /></span></span></span></p>\r\n\r\n<p><strong><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"box-sizing: border-box; font-weight: 700; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\"><span style=\"color:#FFFFFF;\">Việc thờ Phật tại gia từ lâu đã trở thành một phong tục quen thuộc của các tín đồ Phật Giáo để cầu bình an. Mỗi một pho tượng Phật &nbsp;mang một ý nghĩa khác nhau, trong đó&nbsp;</span><a href=\"http://tuonggohungthinh.vn/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(0, 0, 255); text-decoration-line: none; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\"><span style=\"color:#FFFFFF;\">tượng gỗ Phật Di Lặc</span></a><span style=\"color:#FFFFFF;\">&nbsp;đại diện cho sự tươi vui và hạnh phúc viên mãn đang được khá nhiều người chọn lựa trong thời gian gần đây.&nbsp;</span></span></span></span></span></strong></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><strong><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"box-sizing: border-box; font-weight: 700; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; text-align: justify;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\"><img alt=\"tượng Di Lặc \" src=\"/upload/images/1(9).png\" style=\"width: 600px; height: 800px;\" /></span></span></span></span></strong></span></p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; text-align: justify;\">Trong phong thủy, Phật Di Lặc được cho là mang lại may mắn và hạnh phú</span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; text-align: justify;\">c, giải tỏa những muộn phiền thành sự vui vẻ và hạnh phúc. Điểm đặc biệt nhất mỗi khi nhìn vào tượng Phật Di Lặc đó chính là nụ cười hoan hỉ bất diệt, là tấm lòng bao dung độ lượng không bờ bến. Tướng nụ cười của Phật cho người nhìn cảm giác vô lượng từ tâm, thanh thản nhẹ nhàng. Tướng lỗ tai dài biểu thị sự từ ái, lỗ tai biết lắng nghe ai khen cũng cười, ai chê cũng cười chằng phật lòng ai. Tướng bụng tròn thể hiện lòng từ bi rộng lớn sẽ chứa hết mọi chuyện buồn thế gian. Dân gian truyền nhau rằng xoa bụng Phật Di Lặc sẽ gặp được may mắn. Chiêc túi vài đơn sơ người quải trên vai cũng là dùng để đựng vô lượng diệu pháp bố thí cho chúng sinh. Thân hình mập mạp, nụ cười tươi tắn làm cho người trở nên gần gũi hơn với mọi người, để Phật có thể nghe tiếng lòng than thở mà hóa giải điêu ấy thành niềm vui, mang nụ cười bất diệt đến thế gian.</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#FFFFFF;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Chi tiết + Báo giá: vui lòng liên hệ</span></span></span></p>\r\n', '', '', '', 'Tượng Phật Di Lặc', '', '', '', 'Tượng Phật Di Lặc', '', '', '', 'tượng phật di lặc, ', ', ', '', '', 'Chi tiết + Báo giá: vui lòng liên hệ', '', '', '', 'Tượng Phật Di Lặc', '', '', '', 'Tượng Phật Di Lặc', '', '', '', 'Tượng Phật Di Lặc', '', 'Tượng Phật Di Lặc', '', 'Tượng Phật Di Lặc', '', 'Tượng Phật Di Lặc', '', 36, 0, '', '', 0, 1505720586, 0, '', 1, 10, 1, 1, 1505720553, 1505720583, 60, '', 'bosuutap'),
