n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><img alt=\"Hoàn thiện showroom\" src=\"http://tamnhinsongda.com/upload/images/z726101495271_86e5df433d73c8e4a5c25d4acdf9c4b8.jpg\" style=\"margin: 0px; box-sizing: border-box; border: 0px; vertical-align: middle; max-width: 100%; height: 960px; width: 1280px;\" /></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><img alt=\"Hoàn thiện thi công\" src=\"http://tamnhinsongda.com/upload/images/z726102164153_c1c906e308ecde3376d499b852883de0.jpg\" style=\"margin: 0px; box-sizing: border-box; border: 0px; vertical-align: middle; max-width: 100%; height: 960px; width: 1280px;\" /></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><img alt=\"Hoàn thiện công trình\" src=\"http://tamnhinsongda.com/upload/images/z726101962878_a304af02c679b8c9fc9300b62e181910.jpg\" style=\"margin: 0px; box-sizing: border-box; border: 0px; vertical-align: middle; max-width: 100%; height: 960px; width: 1280px;\" /></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\">Để có được kết quả cuối cùng, để theo đúng lộ trình và tầm nhìn được đưa ra: Kiến tạo nên cái đẹp&nbsp;</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\">Chuẩn bị cho sự ra đời của một công trình kiến trúc được xây dựng bởi sự hợp tác giữa Tầm nhìn sông Đà và Vietsolutions:&nbsp;</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><img alt=\"Hoàn thiện công trình\" src=\"http://tamnhinsongda.com/upload/images/z726101145874_22ba22ba65120d44867404e6aca99b69.jpg\" style=\"margin: 0px; box-sizing: border-box; border: 0px; vertical-align: middle; max-width: 100%; height: 1200px; width: 900px;\" /></p>\r\n</div>\r\n</div>\r\n', '', '', '', '', '', 'Hoàn