(647, 0, 33, 0, 0, 'Thi công nhà anh Dũng [BIÊN HÒA]', '', 'thi-cong-nha-anh-dung-bien-hoa', '', '', 0, 0, 0, '', '', '', '', '', 'Kiến trúc hiện đại', '', '<p style=\"margin: 0px; box-sizing: border-box; font-size: 14px; padding: 1em 0px; outline: none; list-style: none; border: 0px none; font-family: Tahoma, Geneva, sans-serif;\"><span style=\"font-size:16px;\"><span style=\"margin: 0px; box-sizing: border-box;\"><span style=\"margin: 0px; box-sizing: border-box;\"><span style=\"margin: 0px; box-sizing: border-box; color: rgb(0, 0, 0);\">Phương án nhà phố được thiết kế trên diện tích 4x15m mang lối sống hiện đại của chủ đầu tư là anh Dũng&nbsp;thi công tại Biên Hòa, Đồng Nai. Tuy diện tích bề ngang ngôi nhà không được nhiều, nhưng kiến trúc sư của Tầm nhìn sông Đà đã cố gắng tận dụng không gian một cách tốt nhất, tạo cảm giác thoải mái cho chủ nhà.</span></span></span></span></p>\r\n\r\n<p style=\"margin: 0px; box-sizing: border-box; font-size: 14px; padding: 1em 0px; outline: none; list-style: none; border: 0px none; font-family: Tahoma, Geneva, sans-serif;\"><span style=\"font-size:16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Source Serif Pro&quot;, serif; font-size: 21px; vertical-align: baseline; outline: 0px; background: transparent; color: rgba(0, 0, 0, 0.7);\">Phương cách thiết kế mặt tiền nhà phố hiện đại được nhắm đến sự tiết kiệm và tối ưu theo mức tốt nhất thông qua nguyên vật liệu xây dựng nhưng không vì thế mà lại đánh mất đi vẻ đẹp trong kiến trúc hiện đại.</strong></span></p>\r\n\r\n<p style=\"margin: 0px; box-sizing: border-box; font-size: 14px; padding: 1em 0px; outline: none; list-style: none; border: 0px none; font-family: Tahoma, Geneva, sans-serif;\"><span style=\"margin: 0px; box-sizing: border-box; font-size: 16px;\"><span style=\"margin: 0px; box-sizing: border-box; font-family: &quot;times new roman&quot;, times, serif;\"><span