(648, 0, 33, 0, 0, 'Thi công Biệt thự nhà anh Chương [QUẬN 9]', '', 'thi-cong-biet-thu-nha-anh-chuong-quan-9', '', '', 0, 0, 0, '', '', '', '', '', 'Kiến trúc cổ điển', '', '<p style=\"margin: 0px; box-sizing: border-box; font-size: 14px; padding: 1em 0px; outline: none; list-style: none; border: 0px none; font-family: Tahoma, Geneva, sans-serif;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; box-sizing: border-box; font-size: 14px; padding: 1em 0px; outline: none; list-style: none; border: 0px none; font-family: Tahoma, Geneva, sans-serif;\"><span style=\"font-size:18px;\"><span style=\"font-family:times new roman,times,serif;\">Tuy chỉ đang thi công phần thô nhưng công trình đã toát nên được vẻ vương giả, sang trọng ở những đường viền nơi chóp mái, hoa văn,&nbsp;pháo chỉ&nbsp;cùng các trụ đối xứng. Đây có thể nói là đặc điểm độc tôn của lối Kiến Trúc Cổ Điển, dù theo đuổi một dạng kiến trúc nhưng mỗi ngôi nhà xây dựng nên đều mang những đường nét rất riêng trên mình, không hề rập khuôn cứng nhắ ngược lại còn vô cùng khác biệt.</span></span></p>\r\n\r\n<p style=\"margin: 0px; box-sizing: border-box; font-size: 14px; padding: 1em 0px; outline: none; list-style: none; border: 0px none; font-family: Tahoma, Geneva, sans-serif;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px; box-sizing: border-box; font-size: 14px; padding: 1em 0px; outline: none; list-style: none; border: 0px none; font-family: Tahoma, Geneva, sans-serif;\"><span style=\"margin: 0px; box-sizing: border-box; font-size: 16px;\"><span style=\"margin: 0px; box-sizing: border-box; font-family: &quot;times new roman&quot;, times, serif;\"><span style=\"margin: 0px; box-sizing: border-box; color: rgb(0, 0, 0);\">Thông tin dự án:</span></span></span></p>\r\n\r\n<ul style=\"margin: 0px 0px 25px 10px; box-sizing: border-box; padding-right: 0px; padding-left: 0px; font-size: 14px; outline: none; list-style: none; border: 0px none; font-family: Tahoma, Geneva, sans-serif;\">\r\n	<li style=\"margin: 0px 0px 5px 10px; box