(743, 0, 31, 0, 0, 'Căn hộ quận 4 với phong cách hiện đại', '', 'can-ho-quan-4-voi-phong-cach-hien-dai', '', '', 0, 0, 0, '', '', '', '', '', 'Chủ đầu tư: Anh Nhân\r\n\r\nĐịa chỉ công trình: Quận 4, Tp.HCM\r\n\r\nCông việc thực hiện:  Thiết kế - thi công\r\n\r\nChi phí thiết kế: 80 nghìn/m2\r\n\r\nDiện tích: 84m2', '', '<p><strong><span style=\"font-size:26px;\">Căn hộ quận 4 với phong cách hiện đại</span></strong></p>\r\n\r\n<p><strong>Chủ đầu tư:</strong> Anh Nhân</p>\r\n\r\n<p><strong>Địa chỉ công trình:</strong> Quận 4, Tp.HCM</p>\r\n\r\n<p><strong>Công việc thực hiện:</strong>&nbsp; Thiết kế - thi công</p>\r\n\r\n<p><strong>Chi phí thiết kế:</strong> 80 nghìn/m2</p>\r\n\r\n<p><strong>Diện tích</strong>: 84m2</p>\r\n\r\n<p style=\"text-align: center;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------</p>\r\n\r\n<p>Với diện tích nhỏ, căn hộ được thiết kế theo không gian mở, đó là không có sự ngăn cách giữa&nbsp;phòng khách, phòng bếp và phòng ăn, tuy nhiên vẫn đảm bảo được sự tiên nghi cần thiết cho gia chủ</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/03-01-2018/noi%20that%20hien%20dai%20004.jpg\" style=\"text-align: center; width: 800px; height: 533px;\" /></p>\r\n\r\n<p>Vách kính ngăn cách không gian giữa phòng ngủ và phòng khách, nhưng tạo được cảm giác rộng rãi cho căn hộ đồng thời giúp lấy sáng vào các không gian bên trong. Bộ rèm với màu sắc sang trọng mang tác dụng tạo không gian riêng tư khi cần cho gia chủ.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/03-01-2018/noi%20that%20hien%20dai%20006.jpg\" style=\"text-align: center; width: 800px; height: 533px;\" /></p>\r\n\r\n<p>Phần bếp được thiết kế theo mô típ bếp ốc đảo hiện đại. Phần bếp ốc đảo tạo cho gia chủ sự thoải mái và tiện dụng&nbsp;<span style=\"text-align: center;\">khi sử dụng</span></p>\r\n\