(753, 0, 31, 0, 0, 'CĂN HỘ THÔNG MINH QUẬN 2', '', 'can-ho-thong-minh-quan-2', '', '', 0, 0, 0, '', '', '', '', '', 'Mặc dù không gian nhỏ hẹp, tuy nhiên căn hộ vẫn được thiết kế đầy đủ không gian. Điều đặc biệt trong căn hộ này đó là, phòng khách và phòng ngủ được kết hợp sử dụng chung không gian, nội thất căn phòng được thiết kế linh động, có thể thay đổi để tạo ra không gian phù hợp khi cần sử dụng.', '', '<p><span style=\"font-size:26px;\">CĂN HỘ THÔNG MINH QUẬN 2</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><span style=\"margin: 0px; box-sizing: border-box; font-weight: 700;\">Chủ đầu tư:</span>&nbsp;Anh Long</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><span style=\"margin: 0px; box-sizing: border-box; font-weight: 700;\">Địa chỉ công trình:</span>&nbsp;Quận 2, Tp.HCM</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\"><span style=\"margin: 0px; box-sizing: border-box; font-weight: 700;\">Công việc thực hiện:</span>&nbsp; Thiết kế - thi công</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px;\">&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px;\">Mặc dù không gian nhỏ hẹp, tuy nhiên căn hộ vẫn được thiết kế đầy đủ không gian. Điều đặc biệt trong căn hộ này đó là, phòng khách và phòng ngủ được kết hợp sử dụng chung không gian, nội thất căn phòng được thiết kế linh động, có thể thay đổi để tạo ra không gian phù hợp khi cần sử dụng. Nền nhà bằng gỗ sử dụng tông màu nâu kết hợp với đèn vàng, tạo nên không gian ấm cúng khi sử dụng. Nội thất được thiết kế theo những mẫu hiện đại nhất tạo nên không gian tiện lợi cho gia chủ.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/upload/images/03-15-2018/noi%20that%20hien%20dai%2004.jpg\" style=\"width: 800px; height: 617px;\" /></span></span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/upload/images/03-15-2018/noi%20that%20hien%20dai%2006.jpg\" style=\"text-align: center; width: 800px; height: 701px;\" /></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px;\">Phòng khách và bếp được kết nối, điều này giúp giải phóng không gian cho căn hộ.</span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/upload/images/03-15-2018/noi%20that%20hien%20dai%2005.jpg\" style=\"height: 593px; width: 800px;\" /></span></span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/upload/images/03-15-2018/noi%20that%20hien%20dai%2003.jpg\" style=\"text-align: center; width: 800px; height: 705px;\" /></span></span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/upload/images/03-15-2018/noi%20that%20hien%20dai%2001.jpg\" style=\"text-align: center; width: 800px; height: 705px;\" /></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\">Sofa được thiết kế thông minh, khi kéo xuống sẽ trở thành giường ngủ. Không gian phòng khách trở thành phòng ngủ.</span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/upload/images/03-15-2018/noi%20that%20hien%20dai%2002.jpg\" style=\"text-align: center; height: 705px; width: 800px;\" /></span></span></p>\r\n\r\n<p><span style=\"font-size:14px;\">Sử dụng nội thất thông minh, kết hợp với thiết kế không gian, căn hộ với diện tích nhỏ vẫn có đầy đủ những tiện nghi cần thiết cho gia chủ. Căn hộ phù hợp với những người độc thân hoặc cặp đôi mới cưới.</span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px; text-align: center;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"margin: 0px; box-sizing: border-box;\"><span style=\"margin: 0px; box-sizing: border-box;\">-----------------------------------------------------------------------------</span></span></span></span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px; text-align: center;\"><span style=\"font-size:26px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"margin: 0px; box-sizing: border-box; font-weight: 700;\"><span style=\"margin: 0px; box-sizing: border-box;\"><span style=\"margin: 0px; box-sizing: border-box; color: rgb(0, 0, 128);\"><span style=\"margin: 0px; box-sizing: border-box;\">CÔNG TY TNHH TẦM NHÌN SÔNG ĐÀ</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin: 0px 0px 10px; box-sizing: border-box; font-family: UTMAvo_r; font-size: 14px; text-align: center;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"margin: 0px; box-sizing: border-box;\">Liên hệ&nbsp;<span style=\"margin: 0px; box-sizing: border-box; font-weight: 700;\">Mr. Hiếu Trương - 0909 904 364</span>&nbsp;để được tư vấn trực tiếp!</span></span></span></p>\r\n', '', '', '', '', '', 'CĂN HỘ THÔNG MINH QUẬN 2', '', '', '', '', 232, 1, 1521098632, 1521098657, 'can-ho-thong-minh-quan-231313.jpg', 'can-ho-thong-minh-quan-231313_75x83.jpg', 'CĂN HỘ THÔNG MINH 