(765, 0, 18, 0, 0, 'Ngôi nhà đẹp hiện đại với khu vườn thẳng đứng cao 2 tầng', '', 'ngoi-nha-dep-hien-dai-voi-khu-vuon-thang-dung-cao-2-tang', '', '', 0, 0, 0, '', '', '', '', '', 'Ngôi nhà mang phong cách hiện đại xen lẫn chút thô mộc của đá, sỏi. Những mảng gỗ hoa văn truyền thống hay họa tiết cắt bằng công nghệ CNC sắc nét tạo điểm nhấn cho ngôi nhà.', '', '<p><span style=\"font-size:16px;\">Ngôi nhà 3,5 tầng được xây từ 15 năm trước trở nên thông thoáng và bừng sáng nhờ khu vườn thẳng đứng cùng khoảng thông tầng lớn.</span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/001.jpg\" style=\"width: 680px; height: 493px;\" /></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Để cải tạo ngôi nhà, các KTS đã phá bỏ nhiều tường ngăn và đục cả một phần mái garage để tạo khoảng thông tầng</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/002.jpg\" style=\"width: 680px; height: 454px;\" /></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Các KTS bố trí khu vườn thẳng đứng tại khu vực được đục trần</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/003.jpg\" style=\"width: 680px; height: 453px;\" /></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Lối vào nhà khá rộng với một phía là vườn cây, bên còn lại là hồ nước</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/004.jpg\" style=\"width: 500px; height: 749px;\" /></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Khoảng thông tầng lớn giúp ngôi nhà có thêm thông thoáng và nhiều ánh sáng</span><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/005.jpg\" /></p>\r\n\r\n<p><span style=\"font-size:16px;\">Các phòng sử dụng cửa kính để tận dụng nguồn sáng và tầm nhìn xanh mướt</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/006.jpg\" style=\"width: 500px; height: 702px;\" /></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Nhờ có khoảng vườn nên ban đêm, các phòng ở tầng một không cần đóng cửa.</span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Phòng khách và bếp tách biệt nhưng vẫn có thể liên thông khi cần thiết.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/007.jpg\" style=\"width: 500px; height: 694px;\" /></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Khu sinh hoạt chung nhìn đẹp ra vườn cây và hồ nước ngoài hiên</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/008.jpg\" style=\"width: 500px; height: 749px;\" /></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Khu vệ sinh rộng rãi nhìn ra vườn cây thẳng đứng</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/010.jpg\" style=\"width: 680px; height: 454px;\" /></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Nhà bếp lớn gồm hai khu vực bên trong và bên ngoài nhà</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/011.jpg\" style=\"width: 680px; height: 454px;\" /></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Ngôi nhà xinh xắn này còn có nhiều khoảng nghỉ với khung cửa sổ lắp rèm</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4%91%E1%BB%A9ng%20cao%202%20t%E1%BA%A7ng/012.jpg\" style=\"width: 500px; height: 676px;\" /></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Ngôi nhà mang phong cách hiện đại xen lẫn chút thô mộc của đá, sỏi. Những mảng gỗ hoa văn truyền thống hay họa tiết cắt bằng công nghệ CNC sắc nét tạo điểm nhấn cho ngôi nhà.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px;\"><img alt=\"\" src=\"/upload/images/4.12%20Ng%C3%B4i%20nh%C3%A0%20%C4%91%E1%BA%B9p%20hi%E1%BB%87n%20%C4%91%E1%BA%A1i%20v%E1%BB%9Bi%20khu%20v%C6%B0%E1%BB%9Dn%20th%E1%BA%B3ng%20%C4