(772, 0, 18, 0, 0, 'Hoàn thiện nhà phố quận 4', '', 'hoan-thien-nha-pho-quan-4', '', '', 0, 0, 0, '', '', '', '', '', '', '', '<p style=\"text-align: center;\"><span style=\"font-size:26px;\"><strong>Hoàn thiện nhà phố quận 4</strong></span></p>\r\n\r\n<p><span style=\"font-size:16px;\">Căn nhà với thiết kế hiện đại, mặt tiền sử dụng hai tông màu trắng xám là chủ yếu.</span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/001.jpg\" style=\"width: 800px; height: 1200px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/002.jpg\" style=\"width: 800px; height: 533px;\" /></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:16px;\">Ngay lối vào là mảng tường gỗ, tạo điểm nhấn cho không gian phòng khách</span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/003.jpg\" style=\"width: 800px; height: 533px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">Phòng khách và bếp được thiết kế theo phong cách mở tạo sự thông thoáng cho căn nhà, đặc biệt là phòng bếp.</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/004.jpg\" style=\"width: 800px; height: 533px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">Mảng tường xanh ngọc là điểm nhấn để tạo nên sự độc đáo cho hệ tủ bếp</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/005.jpg\" style=\"width: 800px; height: 533px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/006.jpg\" style=\"width: 800px; height: 533px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">Nội thất phòng ngủ đơn giản, màu sắc nội thất được phối hợp ăn ý với sàn nhà và tường.</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/007.jpg\" style=\"width: 800px; height: 533px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/008.jpg\" style=\"width: 800px; height: 533px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/009.jpg\" style=\"width: 800px; height: 1200px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/011.jpg\" style=\"width: 800px; height: 1200px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">Vách ngăn mộc mạc.</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/012.jpg\" style=\"width: 800px; height: 1200px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/014.jpg\" style=\"height: 533px; width: 800px;\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/images/4.10%20Nha%20pho%20hien%20dai%202/015.jpg\" style=\"width: 800px; height: 1200px;\" /></p>\r\n\r\n<p style=\"text-align: center;